"use strict";(self.webpackChunkblogsaurus=self.webpackChunkblogsaurus||[]).push([[1477],{10:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"Bloc","metadata":{"permalink":"/blog/Bloc","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-20-til5/index.md","source":"@site/blog/2023-12-20-til5/index.md","title":"Flutter TIL - 3","description":"---","date":"2023-12-20T00:00:00.000Z","formattedDate":"December 20, 2023","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"riverpod","permalink":"/blog/tags/riverpod"},{"label":"notifier","permalink":"/blog/tags/notifier"},{"label":"dart \uc0dd\uc131\uc790","permalink":"/blog/tags/dart-\uc0dd\uc131\uc790"}],"readingTime":1.245,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"Bloc","title":"Flutter TIL - 3","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","riverpod","notifier","dart \uc0dd\uc131\uc790"]},"nextItem":{"title":"Flutter TIL - 2","permalink":"/blog/Bloc"}},"content":"---\\n\\n## NotifierProvider\uc758 notifier \uba54\uc18c\ub4dc\\n---\\n\\n```dart\\nfinal cartProvider = NotifierProvider<RiverpodCart, List<Product>>(() {\\n  return RiverpodCart();\\n});\\n```\\n\\n\ud50c\ub7ec\ud130\ub294 \uc704\ucc98\ub7fc provider\ub97c \uc704\uc82f\ud2b8\ub9ac\uc5d0 \ub530\ub85c \ub4f1\ub85d\ud558\uc9c0 \uc54a\uace0 \ubcc0\uc218\ub85c \uc120\uc5b8\ud574\uc11c \uc0ac\uc6a9\ud55c\ub2e4.\\n\\n```dart\\nreturn ProductTile(\\n  product: product,\\n  isInCart: ref.watch(cartProvider).contains(product),\\n  onPressed: ref.read(cartProvider.notifier).onProductPressed,\\n);\\n```\\n\uc2e0\uae30\ud55c \uac83\uc774 \uc788\uc5c8\ub2e4. \uc774\ub807\uac8c \uc804\uc5ed\ubcc0\uc218\ub85c \uc120\uc5b8\ud55c \uac83\uc744 watch\ud558\uace0 read\ud558\ub294 \uac83\uc740 \uc774\ud574\ub97c \ud588\ub294\ub370 \uac11\uc790\uae30 `.notifier`.. \uc774\uac74 \ubb50\uc9c0\\n\\n\uc2e4\ud5d8\ud574\ubcf4\uace0 \ucc3e\uc544\ubcf4\ub2c8 `.notifier`\ub97c \ubd99\uc774\uba74 \ud574\ub2f9 provider\uc758 class\ub85c \uc811\uadfc\ud574\uc11c \uadf8 class\uc758 \uba54\uc18c\ub4dc \ub4f1\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4\ub294 \uac83.\\n\\n\uc989 \uc704\uc5d0\uc11c cartProvider\uc758 `NotifierProvider<RiverpodCart, List<Product>>` \uc911 \uc55e \ubd80\ubd84\uc778 `RiverpodCart`\uc5d0 \uc811\uadfc\ud558\ub294 \ub290\ub08c\uc774\ub2e4.\\n\\n`.notifier`\ub97c \ubd99\uc774\uc9c0 \uc54a\uc73c\uba74 \uc774 provider\uc758 \uc0c1\ud0dc\ub85c \uc811\uadfc\ud558\ub294 \uac83\uc774\ub2e4.\\n\\n\uc989 `List<Product>`\uc5d0 \uc811\uadfc\ud55c\ub2e4. \uadf8\ub798\uc11c contians \uba54\uc18c\ub4dc\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc5c8\ub2e4.\\n\\n## dart \uc0dd\uc131\uc790\\n---\\n\\n### named parameter\\n\\n\uc0dd\uc131\uc790 \uc548\uc5d0 `{}` \uc911\uad04\ud638\ub85c \ud30c\ub77c\ubbf8\ud130\ub97c \ubb36\uc73c\uba74 named parameter \uac00\ub2a5\\n\\nnamed parameter\ud558\uba74 required \ud560 \uc218\ub3c4 \uc788\ub2e4."},{"id":"Bloc","metadata":{"permalink":"/blog/Bloc","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-19-til4/index.md","source":"@site/blog/2023-12-19-til4/index.md","title":"Flutter TIL - 2","description":"---","date":"2023-12-19T00:00:00.000Z","formattedDate":"December 19, 2023","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"const","permalink":"/blog/tags/const"},{"label":"provider","permalink":"/blog/tags/provider"},{"label":"riverpod","permalink":"/blog/tags/riverpod"}],"readingTime":6.495,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"Bloc","title":"Flutter TIL - 2","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","const","provider","riverpod"]},"prevItem":{"title":"Flutter TIL - 3","permalink":"/blog/Bloc"},"nextItem":{"title":"Flutter TIL - 1","permalink":"/blog/Bloc"}},"content":"---\\n\\n## const\uc5d0 \ub300\ud574\\n---\\n\\nclass\uc5d0\uc11c \uc0dd\uc131\uc790\ub97c `const`\ub85c \ub9cc\ub4e4\uc9c0 \uc54a\uc558\uc744 \ub54c\\n\\n```dart\\nclass Product {\\n  final int id;\\n  final String name;\\n  final String desc;\\n  final String price;\\n  final String imageUrl;\\n\\n  Product({\\n    required this.id,\\n    required this.name,\\n    required this.desc,\\n    required this.price,\\n    required this.imageUrl,\\n  });\\n}\\n```\\n\\n\uc704\ucc98\ub7fc \ub9cc\ub4e4\uba74 \uc544\ub798 \ucf54\ub4dc\ub294 \uc5d0\ub7ec\ub09c\ub2e4.\\n\\n```dart\\nconst List<Product> storeProductList = [];\\n```\\n\\n\uc0dd\uc131\uc790 Product\uc5d0 `const`\ub97c \ubd99\uc5ec\uc8fc\uba74 \ud574\uacb0\ud560 \uc218 \uc788\ub2e4.\\n\\n## context.read\uc5d0 \ub300\ud574\\n---\\n\\n```dart\\nvoid main() {\\n  runApp(\\n    MultiProvider(\\n      providers: [\\n        ChangeNotifierProvider(\\n          create: (context) => MyCart(),\\n        ),\\n        ChangeNotifierProvider(\\n          create: (context) => MyBadge(myCart: context.read()),\\n        ),\\n      ],\\n      child: MaterialApp(\\n        home: MyApp(),\\n      ),\\n    ),\\n  );\\n}\\n```\\n\\n\ucf54\ub4dc \uc0c1\ud669\uc774 \uc704\uc640 \uac19\uc744 \ub54c \uc5b4\ub5bb\uac8c MyCart\uc758 \uc815\ubcf4\ub97c `contex.read()`\ub85c \uac00\uc838\uc624\ub098 \uc758\ubb38\uc774 \uc788\uc5c8\ub2e4.\\n\\n\ubcf8\ub860\ubd80\ud130 \ub9d0\ud558\uba74\\n\\n```dart\\n        ChangeNotifierProvider(\\n          create: (context) => MyBadge(myCart: context.read<MyCart>()),\\n        ),\\n```\\n\\n\uc704\uc640 \uac19\uc774 \uc0ac\uc6a9\ud558\uba74 \ud5f7\uac08\ub9b4 \uc77c\uc774 \uc5c6\uace0 \uac00\uc838\uc62c \uc218 \uc788\ub294 \uc774\uc720\ub294 `ChangeNotifierProvider`\ub97c \ud1b5\ud574\uc11c `MyCart`\ub97c \uc704\uc82f \ud2b8\ub9ac \uc0c1 \ub4f1\ub85d \ud588\uae30\uc5d0 \ubc14\ub85c \uac00\uc838\uc640\uc9c0\ub294 \uac83\uc774\ub2e4. \ub9cc\uc57d \uc911\uac04\uc5d0 `MyStore` \uac19\uc740 \ub2e4\ub978 \uc704\uc82f\uc774 \uc788\uc5c8\ub2e4\uba74 `MyCart`\ub294 \uc800\ub7f0\uc2dd\uc73c\ub85c \uac00\uc838\uc624\uc9c0 \ubabb\ud55c\ub2e4.\\n\\n\\n## List\uc758 \uac12\uc5d0 const\uc5d0 \ub300\ud574\\n---\\n\\n```dart\\nList<Product> cartProductList = const [];\\n```\\n\\n\ub9ac\uc2a4\ud2b8\uc758 \ubd88\ubcc0\uc744 \ubcf4\uc7a5\ud574\uc8fc\uae30 \uc704\ud574 []\uc55e\uc5d0 `const` \ud0a4\uc6cc\ub4dc\ub97c \ubd99\uc77c \uc218 \uc788\ub2e4. `List<Product>` \uc55e\uc5d0 \ubd99\uc774\ub294 \uac83\uacfc\ub294 \ub2e4\ub974\ub2e4. \ub9ac\uc2a4\ud2b8\ub97c \ubc14\uafc0 \uc218 \uc788\uc9c0\ub9cc(\uc694\uc18c \ub9d0\uace0) \ub9ac\uc2a4\ud2b8\uc5d0  \uc9c1\uc811\uc801\uc778 \uac12\uc744\ucd94\uac00\ud558\uac70\ub098 \uc0ad\uc81c \uc218\uc815\uc740 \ubabb\ud55c\ub2e4.\\n\\n\uc0ad\uc81c\ub97c \uc6d0\ud55c\ub2e4\uba74 where\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n```dart\\nlist.where((p)=>p!= product).toList();\\n```\\n\uc704\ucc98\ub7fc \uc791\uc131\ud558\uba74 list\ub97c \ub3cc\uba74\uc11c \ub3cc\uace0 \uc788\ub294 \uac12\uc774 p\uc778\ub370 product\uc640 \ube44\uad50\ud558\uba74\uc11c product\ub294 \ube7c\uace0 \ub2e4\uc2dc \ub9ac\uc2a4\ud2b8\ub97c \ub9cc\ub4dc\ub294 \ucf54\ub4dc\uc774\ub2e4.\\n\\n\ucd94\uac00\ub97c \uc6d0\ud55c\ub2e4\uba74 \\n\\n```dart\\n[...list,product]\\n```\\n\uc544\ub798\ucc98\ub7fc \uac04\ub2e8\ud558\uac8c `...`\uc5f0\uc0b0\uc790\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n\\n## dart \uc790\ub3d9 \ub9e4\uac1c\ubcc0\uc218..?\\n---\\n\\n```dart\\n  void onProductPressed(Product product) {\\n    if (cartProductList.contains(product)) {\\n      cartProductList = cartProductList.where((p) => p != product).toList();\\n    } else {\\n      cartProductList = [...cartProductList, product];\\n    }\\n    notifyListeners();\\n  }\\n```\\n\\n\uc774\ub807\uac8c \ub9e4\uac1c\ubcc0\uc218\uac00 \ud544\uc694\ud55c \ud568\uc218\ub85c \uad6c\ud604\ub3fc\uc788\ub294\ub370 \\n\\n```dart\\n      return ProductTile(\\n        product: product,\\n        isInCart: providerCart.cartProductList.contains(product),\\n        onPressed: providerCart.onProductPressed,\\n      );\\n```\\n\\n\uc774\ub807\uac8c \uc0ac\uc6a9\ud558\uae38\ub798 \uae5c\uc9dd \ub180\ub790\ub2e4. \ubb54\uac00 \uc2f6\uc5c8\ub294\ub370 ProductTile class\uc5d0 \ube44\ubc00\uc774 \uc788\uc5c8\ub2e4.\\n\\n```dart\\n  final Product product;\\n  final bool isInCart;\\n  final void Function(Product product) onPressed;\\n```\\n\\n\uc774\ub807\uac8c onPressed\uac00 \uad6c\ud604\ub3fc\uc788\uc73c\uba74 product\ub97c \ub123\uc9c0 \uc54a\uc544\ub3c4 \uc54c\uc544\uc11c \ub123\uc5b4\uc900\ub2e4\uace0..\\n\\nproduct\ub97c \ub123\uc9c0 \uc54a\uc558\ub294\ub370 \uc5b4\ub5bb\uac8c \uc544\ub0d0\uad6c\uc694? ProductTile \uc704\uc82f\uc744 \ub9cc\ub4e4 \ub54c product\uac12\uc744 \uc804\ub2ec\ud558\uae30 \ub54c\ubb38\uc5d0 \uc778\uc9c0\ud560 \uc218 \uc788\ub2e4\uace0 \ud558\ub124\uc694 !\\n\\n\uc815\ub9ac\ud558\uc790\uba74 \ud2b9\uc815 \uc704\uc82f\uc5d0 a\ub77c\ub294 \uac12\uc744 \ud1b5\ud574\uc11c \uad6c\ud604\ud558\uace0 \uadf8 a\ub77c\ub294 \uac12\uc744 \ub9e4\uac1c\ubcc0\uc218\ub85c \uc0ac\uc6a9\ud558\ub294 \ud568\uc218\uac00 \uc788\uc744 \ub54c \ub2e4\ub978 \ud568\uc218\ub3c4 \uadf8 a\ub77c\ub294 \uac12\uc744 \ud544\uc694\ub85c \ud55c\ub2e4\uba74 \uc0ac\uc6a9\ud558\uc9c0 \uc54a\ub294\ub2e4.. \ub77c\ub294 \uac83\uc785\ub2c8\ub2e4. \uadfc\ub370 100% \uc774\ud574\ub97c \ubabb\ud588\ub2e4. \ub9c8\uc74c\uc5d0 \ub2f4\uc544\ub450\uc790.\\n\\n\\n## context.read() 2\\n---\\n\\n\ud55c \uac00\uc9c0\ub97c \ub354 \uc774\ud574\ud574 \ubc84\ub838\ub2e4.\\n\\n\uc704\uc82f \ud2b8\ub9ac \uc0c1\uc5d0 \ub4f1\ub85d\ud574\uc11c context\ub85c \uac00\uc838\uc62c \uc218 \uc788\ub2e4\uba74\\n\\n```dart\\ncontext.read<ProviderCart>().onProductPressed\\n```\\n\\n\uc704 \ucc98\ub7fc ProviderCart\uc758 \ud568\uc218\ub97c \uac00\uc838\uc62c \uc218 \uc788\ub2e4.\\n\\n## context.select()\\n---\\n\\n\uc774\uac70 \uc880 \uc774\uc0c1\ud558\uae34 \ud558\ub2e4. \uadf8\ub798\uc11c \uc774\uc81c \uc644\ubcbd\ud788 \uc774\ud574\ud588\ub2e4.\\n\\n`context.watch()` : Provider\uc758 \ubaa8\ub4e0 \uc0c1\ud0dc\ub97c \uad6c\ub3c5\ud55c\ub2e4.\\n\\n`context.select()`: Provider\uc758 \ud2b9\uc815 \uc0c1\ud0dc\ub97c \uad6c\ub3c5\ud55c\ub2e4.\\n\\n```dart\\nfinal count = context.select<Counter,int>((counter) => counter.count);\\n```\\n\\n\uc704 \ucc98\ub7fc \uc0ac\uc6a9\ud558\uae30 \ub54c\ubb38\uc5d0 select\ub294 \ud2b9\uc815 \uc0c1\ud0dc \uad6c\ub3c5 \uac00\ub2a5\\n\\n`context.read()`: \uad6c\ub3c5\uc548\ud558\uace0 \ud604\uc7ac \uc0c1\ud0dc \uadf8\ub0e5 \uac00\uc838\uc624\uae30\\n\\n\ub4dc\ub514\uc5b4 context 3\ud615\uc81c\ub294 \uc774\ud574\ud55c\ub4ef\\n\\n## Riverpod\\n---\\n\\nprovider \ub9cc\ub4e0 \uc0ac\ub78c\uc774 \ub9cc\ub4e0\uac70\ub77c\uace0 \ud574\uc11c provider\ub791 \ube44\uc2b7\ud560 \uc904 \uc54c\uc558\ub294\ub370 \ub2e4\ub974\ub2e4.\\n\\nprovider \ub4f1\ub85d\uc744 MultiProvider\uc5d0 \ub4f1\ub85d\ud558\ub294 \uac83\uc774 \uc544\ub2cc \uadf8\ub0e5 \uc804\uc5ed \ubcc0\uc218\ub85c \ub4f1\ub85d\ud55c\ub2e4. \ubcc4\ub3c4 \ubcc0\uc218\uc5d0 \ud560\ub2f9\ud558\uae30 \ub54c\ubb38\uc5d0 \uac19\uc740 Provider\ub97c \ub2e4\ub978 \ubcc0\uc218\uc5d0 \ud560\ub2f9\ud560 \uc218 \uc788\ub2e4. \uadf8\ub9ac\uace0 BuildContex\ub97c \uc0ac\uc6a9\ud558\uc9c0 \uc54a\uace0 \ubcc4\ub3c4\uc758 WidgetRef\ub77c\ub294 \uac83\uc744 \uc0ac\uc6a9\ud55c\ub2e4.\\n\\n\\n:::tip \ubcc0\uacbd\uc810 \uc815\ub9ac\\n1. provider\ub97c \uc804\uc5ed \ubcc0\uc218\ub85c \uc120\uc5b8\ud574\uc11c \uc0ac\uc6a9\\n2. BuildContext \ub300\uc2e0 WidgetRef \uc0ac\uc6a9\\n:::\\n\\n\ub098\uba38\uc9c0\ub294 \ucc28\ucc28 \uc54c\uc544\uac00\ubcf4\ub294\uac78\ub85c\\n\\n\\n`StatelessWidget`\uc740 `ConsumerWidget`\uc73c\ub85c \ubc14\uafd4\uc57c\ud55c\ub2e4.\\n\uadf8\ub9ac\uace0 `build()`\uba54\uc18c\ub4dc \ud30c\ub77c\ubbf8\ud130\uc5d0 `WidgetRef ref`\ub97c \ucd94\uac00\ud574\uc57c ref\uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n`StatefulWidget`\uc740 `ConsumerStatefulWidget`\uc73c\ub85c \ubc14\uafd4\uc57c \ud55c\ub2e4.\\n\\n\ubc14\uafb8\uae30 \uc2eb\uc73c\uba74 `Consumer` \uc704\uc82f\uc73c\ub85c \uac10\uc2f8\uc11c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n\\n### provider \uc885\ub958\\n\\n1. `StateProvider` : \ubcc4\ub85c \ud074\ub798\uc2a4 \uc120\uc5b8 \uc5c6\uc774 \uac00\ubccd\uac8c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n2. `NotifierProvider` : \ud074\ub798\uc2a4\ub97c \ub9cc\ub4e4\uc5b4\uc11c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n3. `Provider` : \uae30\uc874 Provider\uc758 Provider\uc640 \uac19\uc74c \uc989 \uc0c1\ud0dc\uac00 \uc5c6\ub294 Provider\ub4e4\\n\\n### \uc7a1\uae30\uc220\\n\\n1. `AutoDispose` : `NotifierProvider`\ub4a4\uc5d0 `.autoDispose`\ub97c \ubd99\uc774\uace0 `Notifier` extends\ud55c \uac83\uc744 `AutoDisposeNotifier`\ub85c \uc218\uc815\ud558\uba74 \ub429\ub2c8\ub2e4. \uc790\ub3d9\uc73c\ub85c dispose \ud574\uc90d\ub2c8\ub2e4.\\n\\n2. `family` : `NotifierProvider`\ub4a4\uc5d0 `family`\ub97c \ucd94\uac00\ud574\uc11c \uc0ac\uc6a9\ud558\uba74 \ub418\ub290\ub370 \ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785\uc744 \ucd94\uac00\ud574\uc8fc\uba74 `build()`\uc5d0 \ub9e4\uac1c\ubcc0\uc218 \ucd94\uac00\ud574\uc11c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n3. `AutoDisposeFamilyNotifier` : 1,2\ubc88\uc744 \ud569\uce5c \uac83.\\n\\n\\n## Error: Unable to find git in your PATH.\\n---\\n\\n\uac04\ud639 flutter\ub97c \ucc98\uc74c\ud560 \ub54c \uc544\ub798\uc640 \uac19\uc740 \uc5d0\ub7ec\uac00 \uad34\ub86d\ud78c\ub2e4.\\n\\n```bash\\nError: Unable to find git in your PATH. \\n```\\n\\n```bash\\ngit config --global --add safe.directory \'*\'\\n```\\n\\n\uc704 \uba85\ub839\uc5b4\ub85c \ud574\uacb0\ud560 \uc218 \uc788\uc74c \uc800\uc7a5\uc18c \uad8c\ud55c \ubb38\uc81c\uc778 \uac83\uac19\ub2e4. \uad00\ub9ac\uc790 powershell\uc740 flutter \ub410\uc5c8\uc74c"},{"id":"Bloc","metadata":{"permalink":"/blog/Bloc","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-16-til3/index.md","source":"@site/blog/2023-12-16-til3/index.md","title":"Flutter TIL - 1","description":"---","date":"2023-12-16T00:00:00.000Z","formattedDate":"December 16, 2023","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"Bloc","permalink":"/blog/tags/bloc"}],"readingTime":2.46,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"Bloc","title":"Flutter TIL - 1","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","Bloc"]},"prevItem":{"title":"Flutter TIL - 2","permalink":"/blog/Bloc"},"nextItem":{"title":"MVVM \uc544\ud0a4\ud14d\ucc98","permalink":"/blog/mvvm"}},"content":"---\\n\\n\uc77c\ub2e8 vs code \ud655\uc7a5\uc740 `bloc`, `dart data class generator`, `dart-import`, `pubspec assist`\\n\\n`dart data class generator`\uac00 \uc788\uc73c\uba74 \ucf54\ub4dc \uc790\ub3d9 \uc0dd\uc131\uc744 \ud3b8\ud558\uac8c \ud574\uc900\ub2e4. (copyWith, constructor \ub4f1.. )\\n\\n`pubspec assist`\uac00 \uc788\uc73c\uba74 \ud328\ud0a4\uc9c0\ub97c \uc27d\uac8c \ub123\uc744 \uc218 \uc788\uc74c\\n\\n\\n## Bloc\uc5d0 \ub300\ud574\uc11c\\n---\\n\\n\uc601\uc0c1\uc744 \ubcf4\uba70 \ub530\ub77c\ud558\uba74\uc11c \uc800\ubc88\uc8fc\uc5d0 KOSTA\uc5d0\uc11c \ubc30\uc6b4 Bloc \uc0ac\uc6a9\ubc95\uc5d0 \ub300\ud574 \uc775\ud788\uace0 \uc788\uc5c8\ub2e4.\\n\\n\uc601\uc0c1\uc740 \ub2e4\ub978 \ubc29\uc2dd\uc774\ub77c \ud5f7\uac08\ub838\ub294\ub370 VS Code\uc758 Bloc extension\uc744 \uc0ac\uc6a9\ud558\uc5ec New Bloc\uc744 \ud574\uac00\uc9c0\uad6c Bloc\uc744 \ub9cc\ub4e4\uc5c8\ub2e4.\\n\\n3\uac1c\uc758 \ud30c\uc77c\uc774 \ub098\uc628\ub2e4. `bloc`,`event`,`state`\\n\\n### state\\n\\n```dart\\nclass TasksState extends Equatable {\\n  const TasksState({\\n    this.allTasks = const <Task>[],\\n  });\\n\\n  final List<Task> allTasks;\\n\\n  @override\\n  List<Object> get props => [allTasks];\\n}\\n```\\n\\n\ud604\uc7ac state\uc5d0\ub294 `List<Task>` \ud0c0\uc785\uc758 allTasks\ub77c\ub294 \uc0c1\ud0dc\uac00 \ud558\ub098 \uc788\ub2e4.\\n\\n\uc5ec\ub7ec \uac1c \ucd94\uac00\ud558\uba74 \uc5ec\ub7ec \uac1c \ub418\ub294\ub4ef?\\n\\n### event\\n\\n```dart\\nsealed class TasksEvent extends Equatable {\\n  const TasksEvent();\\n\\n  @override\\n  List<Object> get props => [];\\n}\\n\\nclass AddTask extends TasksEvent {\\n  final Task task;\\n  const AddTask({\\n    required this.task,\\n  });\\n\\n  @override\\n  List<Object> get props => [task];\\n}\\n\\nclass UpdateTask extends TasksEvent {\\n  final Task task;\\n  const UpdateTask({\\n    required this.task,\\n  });\\n\\n  @override\\n  List<Object> get props => [task];\\n}\\n\\nclass DeleteTask extends TasksEvent {\\n  final Task task;\\n  const DeleteTask({\\n    required this.task,\\n  });\\n\\n  @override\\n  List<Object> get props => [task];\\n}\\n\\n```\\n\\n\uc774\ub807\uac8c \uc11c\ube44\uc2a4\ub4e4 \ub9cc\ub4e4 \uc218 \uc788\ub2e4. \ud604\uc7ac \uc804\ubd80 \uad6c\ud604\ub41c\uac74 \uc544\ub2cc.. \uac70\uac19\uc740\ub370 \uc77c\ub2e8 \uc774\ub530 \uc218\uc815\\n\\n\\n### bloc\\n\\n\ud558\ub2e4\uac00 \uae68\ub2ec\uc558\ub2e4.\\n\\n```dart\\nclass TasksBloc extends Bloc<TasksEvent, TasksState> {\\n  TasksBloc() : super(const TasksState()) {\\n    on<AddTask>(_onAddTask);\\n  }\\n\\n  void _onAddTask(AddTask event, emit) {\\n    emit(TasksState(\\n      allTasks: [...state.allTasks, event.task],\\n    ));\\n  }\\n}\\n```\\n\\nBloc\uc744 extends \ud560 \ub54c `Bloc<event, state>`\ub85c \ud558\ub77c\uace0 \ubc30\uc6e0\ub2e4. \uadfc\ub370 \ud560 \ub54c state\ub97c `int`\ub098 `bool`\uac19\uc740 \ud0c0\uc785\uc73c\ub85c\ub9cc \uc9c0\uc815\ud574\uc918\uc11c \uadf8\ub0e5 state\ub85c \uc0ac\uc6a9\ud558\uba74 \ub410\uc5c8\ub294\ub370 class\ub85c state \ud0c0\uc785 \uc9c0\uc815\ud574\uc8fc\ub2c8 state.allTasks\ub85c \ud574\uc57c \ud558\ub354\ub77c.. \\n\\n### \uae68\ub2ec\uc74c\\n\\nbloc\uc5d0\uc11c \ud070 \uc2e4\uc218\uac00 \uc788\uc5c8\ub2e4. \uc704\ucf54\ub4dc \ucc98\ub7fc \uc791\uc131\ud558\uba74 \ub418\ub294\ub370 \ucf54\ub4dc \uc218\ub97c \uc904\uc5ec\ubcf4\uaca0\ub2e4\uace0\\n\\n```dart\\n  void _onAddTask(AddTask event, emit) {\\n    emit(\\n      [...state.allTasks, event.task],\\n    );\\n  }\\n```\\n\\n\uc704\ucc98\ub7fc \uc791\uc131\ud588\ub2e4\uac00 \uc791\ub3d9\uc744 \uc548\ud574\uc11c \uc0b4\uc9dd \uc5b4\uc9c0\ub7ec\uc6e0\ub2e4.\\n\\nBloc\uc774 `Bloc<TasksEvent,TasksState>`\uc774\ub2c8 TasksState type\uc5d0 \ub9de\ucdb0\uc918\uc57c \ud558\ub098\ubcf4\ub2e4."},{"id":"mvvm","metadata":{"permalink":"/blog/mvvm","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-15-til1/index.md","source":"@site/blog/2023-12-15-til1/index.md","title":"MVVM \uc544\ud0a4\ud14d\ucc98","description":"---","date":"2023-12-15T00:00:00.000Z","formattedDate":"December 15, 2023","tags":[{"label":"KOSTA","permalink":"/blog/tags/kosta"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"mvvm","permalink":"/blog/tags/mvvm"}],"readingTime":1.42,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"mvvm","title":"MVVM \uc544\ud0a4\ud14d\ucc98","authors":["kihyun"],"tags":["KOSTA","\ud50c\ub7ec\ud130","flutter","mvvm"]},"prevItem":{"title":"Flutter TIL - 1","permalink":"/blog/Bloc"},"nextItem":{"title":"\ud14c\uc2a4\ud2b8 \ucf54\ub4dc","permalink":"/blog/test code"}},"content":"---\\n\\n## \uad00\uc2ec\uc0ac \ubd84\ub9ac\\n---\\n\\n\ubaa8\ub4c8 \ubcc4 \uacbd\uacc4\ub97c \ub098\ub204\uace0 \ubaa8\ub4c8\uac04 \uc57d\uc18d\uc744 \uc815\ud558\ub294 \uac83 like a \uc804\uae30 \ucf58\uc13c\ud2b8\uc640 \ud50c\ub7ec\uadf8\uc758 \uad00\uacc4\ub77c\uace0 \ud55c\ub2e4.\\n\\n\\n## MVVM \uc774\ub860\\n---\\n\\n`View`\uc640 `ViewModel` \uadf8\ub9ac\uace0 `Model`\uc744 \ub098\ub204\uc5b4 View\ub97c \uc27d\uac8c \ubcc0\uacbd\ud560 \uc218 \uc788\ub294 \ubaa9\uc801\uc744 \uac16\uace0 \uc788\ub294 \uc544\ud0a4\ud14d\ucc98 \ud328\ud134\\n\\n:::tip \uc5ed\ud560\\n`View` : UI  \\n`ViewModel`: View \uc0c1\ud0dc \ubc0f \ub85c\uc9c1 \ub2f4\ub2f9  \\n`Model`: \ube44\uc9c0\ub2c8\uc2a4 \ub85c\uc9c1\uacfc \ub370\uc774\ud130 \uc785\ucd9c\ub825 \ub2f4\ub2f9\\n:::\\n\\n\ud575\uc2ec\uc740 `\ub370\uc774\ud130 \ubc14\uc778\ub529`\uc774\ub2e4.\\n\\n`\ub370\uc774\ud130 \ubc14\uc778\ub529`\uc774\ub780 \uac04\ub2e8\ud788 \ub9d0\ud558\uba74 ViewModel\uacfc View\uac00 \uc11c\ub85c\ub97c \uc758\uc874\ud558\uc9c0 \uc54a\ub294 \uac83 `Provider` \ud328\ud0a4\uc9c0\ub97c \uc0ac\uc6a9\ud574\uc11c \ub370\uc774\ud130 \ubc14\uc778\ub529 \uc774\uc6a9\ud55c\ub2e4\ub294\ub370 \ub098\ub294 Bloc\ub97c \uc0ac\uc6a9\ud574\uc11c \ud558\uace0 \uc2f6\ub2e4.. \ub2f9\uc7a5\uc740 Provider\ub85c \uad6c\ud604\ud574\ubcf4\uae30\\n\\n\ud398\uc774\uc9c0 \ub9c8\ub2e4 \ud558\ub098\uc758 ViewModel\uc774 \uc788\uc5b4\uc57c \ud558\uace0 ViewModel\uc740 View\uc758 \uc0c1\ud0dc\uc640 \ub85c\uc9c1\uc744 \uad00\ub9ac\ud55c\ub2e4.\\n\\nModel\uc740 `Service`, `Model`, `Repository`\uac00 \uc788\ub294\ub370 `Service`\ub294 \uc804\uc5ed \uc0c1\ud0dc\uc640 \ube44\uc9c0\ub2c8\uc2a4 \ub85c\uc9c1\uc744 \uad00\ub9ac\ud558\uace0 `Model`\uc740 \ub370\uc774\ud130 `Repository`\ub294 \ub370\uc774\ud130 \uc694\uccad \ub85c\uc9c1\uc744 \ub2f4\ub2f9\ud55c\ub2e4.\\n\\n\uac4d \ubb54\uac00 \uc5b4\ub824\uc6c0 \ub9ce\uc774 \uc5f0\uc2b5\ud574\ubd10\uc57c\uaca0\ub2e4."},{"id":"test code","metadata":{"permalink":"/blog/test code","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-15-til2/index.md","source":"@site/blog/2023-12-15-til2/index.md","title":"\ud14c\uc2a4\ud2b8 \ucf54\ub4dc","description":"---","date":"2023-12-15T00:00:00.000Z","formattedDate":"December 15, 2023","tags":[{"label":"KOSTA","permalink":"/blog/tags/kosta"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"\ud14c\uc2a4\ud2b8 \ucf54\ub4dc","permalink":"/blog/tags/\ud14c\uc2a4\ud2b8-\ucf54\ub4dc"},{"label":"test code","permalink":"/blog/tags/test-code"}],"readingTime":4.005,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"test code","title":"\ud14c\uc2a4\ud2b8 \ucf54\ub4dc","authors":["kihyun"],"tags":["KOSTA","\ud50c\ub7ec\ud130","flutter","\ud14c\uc2a4\ud2b8 \ucf54\ub4dc","test code"]},"prevItem":{"title":"MVVM \uc544\ud0a4\ud14d\ucc98","permalink":"/blog/mvvm"},"nextItem":{"title":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/\uc640\uc774\uc5b4\uc0e4\ud06c"}},"content":"---\\n\\n[\ud14c\uc2a4\ud2b8 \ucf54\ub4dc \uc791\uc131 \uc694\ub839](https://github.com/flutter/flutter/tree/master/packages/flutter/test/material)\\n\\n\ud14c\uc2a4\ud2b8 \ucf54\ub4dc\ub97c \uc791\uc131\ud558\uba74 \uae30\ub2a5\ub4e4\uc758 \uc758\uc874\uc131\ub3c4 \ud655\uc778\ud560 \uc218 \uc788\uace0 \ud14c\uc2a4\ud2b8\ud560 \uae30\ub2a5\uc774 \ub9ce\uc544\uc9c8 \uc218\ub85d \uc790\ub3d9\ud654 \ud574\ub193\uba74 \uc88b\ub2e4.\\n\\n:::tip \ud14c\uc2a4\ud2b8 \uc885\ub958\\n`\ub2e8\uc704 \ud14c\uc2a4\ud2b8 ( Unit Test )`: \ud2b9\uc815 \ud568\uc218 \ubc0f \ud074\ub798\uc2a4 \ud14c\uc2a4\ud2b8  \\n`\uc704\uc82f \ud14c\uc2a4\ud2b8 ( Widget Test )`: \ub2e8\uc77c \uc704\uc82f \ud14c\uc2a4\ud2b8  \\n`\ud1b5\ud569 \ud14c\uc2a4\ud2b8 ( Integration Test )`: \uc571\uc758 \uc804\uccb4\uc801\uc778 \ud14c\uc2a4\ud2b8 \ub3d9\uc791\\n:::\\n\\n## \ub2e8\uc704 \ud14c\uc2a4\ud2b8\\n---\\n\\n\ub0b4\uc7a5 \ud14c\uc2a4\ud2b8\ub85c \ud14c\uc2a4\ud2b8\ub97c \uc9c4\ud589\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n\ud14c\uc2a4\ud2b8 \ud30c\uc77c\uc740 `\ud30c\uc77c\uc774\ub984_test.dart`\uc5ec\uc57c \ud55c\ub2e4. \uc989 `_test.dart`\ub85c \ub05d\ub098\uc57c \ud568\\n\\n:::tip \ud14c\uc2a4\ud2b8 \uad00\ub828 \ud568\uc218\\n`test()`: \ud14c\uc2a4\ud2b8 \uc2dc\uc791\\n`expect()`: \uac12 \uac80\uc99d  \\n`group()`: \ud14c\uc2a4\ud2b8 \uadf8\ub8f9 \ub9cc\ub4e4\uae30  \\n`setUp()`: \ud14c\uc2a4\ud2b8 \uc2dc\uc791 \uc804 \uc2e4\ud589\ud558\ub294 \ud568\uc218(\uacc4\uc18d \ud14c\uc2a4\ud2b8 \uc2dc\uc791\ud560 \ub54c\ub9c8\ub2e4 \uc2e4\ud589)  \\n`setUpAll()`: \ucd5c\ucd08 \ud55c \ubc88\ub9cc \uc2e4\ud589  \\n`tearDown()`: \ud14c\uc2a4\ud2b8 \ud6c4 \uc2e4\ud589  \\n`tearDownAll()`: \ud14c\uc2a4\ud2b8 \uc885\ub8cc \ud6c4 \ub9c8\uc9c0\ub9c9 \ud55c \ubc88 \uc2e4\ud589\\n:::\\n\\n\ud14c\uc2a4\ud2b8\ub97c \ud558\ub2e4\ubcf4\uba74 \uc65c\ud558\ub098 \uc2f6\uc744 \uc218 \uc788\ub294\ub370 \ubcc0\uacbd\uc5d0 \ub300\ucc98\ud558\uae30 \uc704\ud574\uc11c \uc791\uc131\ud558\ub294 \uac83\uc784. \uc644\uc804 \ubcc0\ud55c\ub2e4\uba74 \ub610 \uc758\ubbf8\uac00 \uc5c6\uc5b4\uc9c0\uae34\ud558\ub294\ub370 \ub9ac\ud329\ud1a0\ub9c1 \ud588\uc744 \ub54c \uac80\uc99d\ud558\ub294 \ub290\ub08c\uc774\ub824\ub098 \uc544\uc9c1\uc740 \uc798 \ubaa8\ub974\uaca0\ub2e4.\\n\\n\\n### Mock Object\\n\\napi \ud1b5\uc2e0 \ud14c\uc2a4\ud2b8 \uac19\uc740 \uacbd\uc6b0 \uc678\ubd80 \ubcc0\uc218\uac00 \ub9ce\uc544\uc11c mock object\ub85c \ud55c\ub2e4.\\n\\n\uc65c\ub0d0\ud558\uba74 \uc2e4\uc81c \uc694\uccad \uc751\ub2f5\uc740 \ubcc0\uc218\uac00 \ub9ce\uc544\uc11c... \uc7ac\ud604\uc774 \uc5b4\ub835\ub2e4. \uadf8\ub9ac\uace0 \uc2e4\uc81c\ub85c \uc11c\ubc84 \uc751\ub2f5 \uc2e4\ud328 \ud14c\uc2a4\ud2b8 \uac19\uc740 \uacbd\uc6b0\ub3c4 \uc27d\uc9c0 \uc54a\ub2e4. mock object\ub97c \uc0ac\uc6a9\ud558\uba74 \uc27d\uac8c \ud560 \uc218 \uc788\ub2e4.\\n\\nmockito\ub791 build_runner\ub97c \uc0ac\uc6a9\ud55c\ub2e4\uace0 \ud55c\ub2e4.\\n\\nmockito\ub85c \uc5b4\ub178\ud14c\uc774\uc158 \ub2ec\uace0 build_runner\ub85c \ucf54\ub4dc \uc0dd\uc131\ud558\ub294 \uac70\uc784\\n\\n\\n### DI ( Dependency Injection )\\n\\ndi\ub97c \ud558\ub294\ub370 \uc0dd\uc131\uc790\ub97c \ud1b5\ud574 \uc678\ubd80 \ucf54\ub4dc\ub97c \ubc1b\ub294\ub2e4\uc778 \uac04\ub2e8\ud55c \uac1c\ub150\uc774\ub77c\uace0 \ud55c\ub2e4.\\n\\n  \\n  \\n\\n## \uc704\uc82f \ud14c\uc2a4\ud2b8\\n---\\n\\n\uc0c1\ud638\uc791\uc6a9, \uc0dd\uae40\uc0c8, \uc0c1\ud0dc \ud655\uc778\uc744 \ud14c\uc2a4\ud2b8 \ud55c\ub2e4\uace0 \ud55c\ub2e4.\\n\\n\\n:::tip \uc704\uc82f \ud14c\uc2a4\ud2b8\\n`testWidgets()`: \ud14c\uc2a4\ud2b8 \uc9c4\ud589  \\n`pump()`: \ud654\uba74 \uac31\uc2e0  \\n`find.text()`: \ud2b9\uc815 \ud14c\uc2a4\ud2b8 \uac80\uc0c9  \\n`find.byType()`: \ud2b9\uc815 \ud074\ub798\uc2a4\uc758 \ud0c0\uc785\uacfc \uc77c\uce58\ud558\ub294 \uc704\uc82f \uac80\uc0c9  \\n`tester.widget()`: \ud2b9\uc815 \ud0c0\uc785\uc758 \uc704\uc82f \uac00\uc838\uc634  \\n`tester.element()`: \ud2b9\uc815 \uc704\uc82f\uc758 BuildContext \uac00\uc838\uc634\\n:::\\n\\n[golden test](https://api.flutter.dev/flutter/flutter_test/matchesGoldenFile.html)\ub3c4 \uc788\ub2e4.\\n\\ngolden test\ub294 \uc774\ubbf8\uc9c0 \ud53d\uc140 \ube44\uad50\ud558\ub294 \ud14c\uc2a4\ud2b8\ub2e4 \uc989 \uc2dc\uac01\uc801 \ubaa8\uc2b5\uc744 \ud14c\uc2a4\ud2b8\ud560 \uc218 \uc788\ub2e4.\\n\\n\\n```bash\\nflutter test --update-goldens\\n```\\n\\n\uc774\uac78\ub85c \uace8\ub4e0\ud14c\uc2a4\ud2b8 \uc815\ub2f5 \uc0dd\uc131\ud574\uc90c \uc2e0\uae30\ud558\ub139.\\n\\n\\n## \ud1b5\ud569 \ud14c\uc2a4\ud2b8\\n---\\n\\nGUI\ud14c\uc2a4\ud2b8 EndToEnd\ub77c\uace0 \ud569\ub2c8\ub2e4.\\n\\n\uc2e4\uc81c \uc5d0\ubbac\ub808\uc774\ud130\ub97c \ud1b5\ud574\uc11c \ud14c\uc2a4\ud2b8\ub97c \ud558\uac8c \ub41c\ub2e4.\\n\\n`integration_test`\ub97c \ucd94\uac00\ud574\uc57c \ud55c\ub2e4\uace0 \ud569\ub2c8\ub2e4.\\n\\n```bash\\n\\n  integration_test:\\n    sdk: flutter\\n```\\n\\ndev_dependecies\uc5d0 \ubd99\uc5ec\ub123\uc5b4\uc8fc\uba74 \ub41c\ub2e4.\\n\\n\\nintegration_test\ub77c\ub294 \ud3f4\ub354\ub97c root\uc5d0 \ub9cc\ub4e4\uc5b4\uc8fc\uace0 \ud558\uba74 \ub41c\ub2e4.\\n\uc544\uc8fc \uc2e0\uae30\ud558\ub2e4.\\n\\n## \ud14c\uc2a4\ud2b8 \ucee4\ubc84\ub9ac\uc9c0\\n---\\n\\n[\ud50c\ub7ec\ud130 \ucee4\ubc84\ub9ac\uc9c0](https://marketplace.visualstudio.com/items?itemName=Flutterando.flutter-coverage)\\n\\n\ud14c\uc2a4\ud2b8 \ucf54\ub4dc \uae30\ubc18\uc73c\ub85c \ucee4\ubc84\ub9ac\uc9c0 \uce21\uc815\uc744 \ud55c\ub2e4.\\n\\n[\ucee4\ubc84\ub9ac\uc9c0 \uac70\ud130\uc2a4](https://marketplace.visualstudio.com/items?itemName=ryanluker.vscode-coverage-gutters)\\n\\n\uc774\uac70\ub294 \ud2b9\uc815 \ud30c\uc77c\uc5d0\uc11c \uc88c\uce21 \ud558\ub2e8 watch\ub97c \ub20c\ub7ec\ubcf4\uba74 \uc5b4\ub514\uac00 \ud14c\uc2a4\ud2b8\uac00 \uc548\ub410\ub294\uc9c0\uc640 \ucee4\ubc84\ub9ac\uc9c0 % \uc54c\ub824\uc900\ub2e4.\\n\\n\\nhydrated bloc\uc744 \uc0ac\uc6a9\ud574\ubcf4\uac70\ub098 \ub2e4\ub978 \uc11c\ub4dc\ud30c\ud2f0\ub4e4 \uac80\uc0c9\ud574\uc11c \ucc3e\uc544\ubcf4\uc790"},{"id":"\uc640\uc774\uc5b4\uc0e4\ud06c","metadata":{"permalink":"/blog/\uc640\uc774\uc5b4\uc0e4\ud06c","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-11-29-KOSTA3/index.md","source":"@site/blog/2023-11-29-KOSTA3/index.md","title":"\uc640\uc774\uc5b4\uc0e4\ud06c","description":"---","date":"2023-11-29T00:00:00.000Z","formattedDate":"November 29, 2023","tags":[{"label":"KOSTA","permalink":"/blog/tags/kosta"},{"label":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/tags/\uc640\uc774\uc5b4\uc0e4\ud06c"}],"readingTime":2.065,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"\uc640\uc774\uc5b4\uc0e4\ud06c","title":"\uc640\uc774\uc5b4\uc0e4\ud06c","authors":["kihyun"],"tags":["KOSTA","\uc640\uc774\uc5b4\uc0e4\ud06c"]},"prevItem":{"title":"\ud14c\uc2a4\ud2b8 \ucf54\ub4dc","permalink":"/blog/test code"},"nextItem":{"title":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/\uc640\uc774\uc5b4\uc0e4\ud06c"}},"content":"---\\n\\n### \uc774\ub984 \ud480\uc774 \uae30\ub2a5 \ucc38\uc870 \ud30c\uc77c\\n\\n- mac address \uc0ac\uc6a9\uc790 \uc815\uc758 C:\\\\Program Files\\\\Wireshark\\\\ethers\\n- port number \uc815\ubcf4 C:\\\\Program Files\\\\Wireshark\\\\services\\n- \ud638\uc2a4\ud2b8 \uc774\ub984 \uc815\ubcf4 C:\\\\Program Files\\\\Wireshark\\\\hosts\\n\\n### \uc640\uc774\uc5b4\uc0e4\ud06c\ub294 \ud3ec\ud2b8\ubc88\ud638\uac00 \uc778\uc2dd\ub418\uc9c0 \uc54a\uc744\ub54c data\ub85c \ud574\uc11d\ub429\ub2c8\ub2e4. \ube44\ud45c\uc900 \ud3ec\ud2b8 \ubc88\ud638\ub97c \uc0ac\uc6a9\ud558\ub294 FTP \uc11c\ube44\uc2a4\ub97c \uc218\ub3d9\uc73c\ub85c \ubd84\uc11d\uae30\ub97c \uc124\uc815\ud558\ub294 \uba54\ub274\ub294 \uc5b4\ub514\uc778\uac00\uc694?\\n\\nAnalyze>Decode as\\n\\n### WLAN \ud504\ub85c\ud30c\uc77c\uc744 \uc0dd\uc131\uc2dc \ud658\uacbd\uc124\uc815 \uc800\uc7a5 \uacbd\ub85c\ub294 \uc5b4\ub514\uc778\uac00\uc694?\\n\\nC:\\\\Users\\\\user1\\\\AppData\\\\Roaming\\\\Wireshark\\\\Profile\\n\\n### \uc6d0\uaca9\uc9c0 \ud2b8\ub798\ud53d \ucea1\uccd0\ub97c \uc218\ud589\ud558\ub824\uace0 \ud569\ub2c8\ub2e4. \ucea1\uccd0\ud558\uace0\uc790 \ud558\ub294 \ucef4\ud4e8\ud130\uc5d0 winpcap\uc744 \uc124\uce58\ud55c \ud6c4 \uc6d0\uaca9\uc9c0\uc5d0 \uc2e4\ud589\ud574\uc57c\ud558\ub294 \ub370\ubaac \uc2e4\ud589\ud30c\uc77c\uc740 \ubb34\uc5c7\uc778\uac00\uc694?\\n\\nrpcapd.exe\\n\\n### \uae30\uc874 \ucd94\uc801\ud30c\uc77c\uc5d0\ub294 \uc801\uc6a9\ud560 \uc218 \uc5c6\uace0 \uc2e4\uc2dc\uac04 \ucea1\uccd0\ud558\ub294 \uc791\uc5c5\uc5d0\ub9cc \uc801\uc6a9\ub418\ub294 \ud544\ud130\ub85c TCPDUMP \uad6c\ubb38\uc758 BPF\ud615\uc2dd\uc744 \ub530\ub974\ub294 \ud544\ud130\ub294 \ubb34\uc5c7\uc778\uac00\uc694?\\n\\n\ucea1\uccd0\ud544\ud130\\n\\n### \uc2e4\uc2dc\uac04 \ucea1\uccd0 \ud544\ud130\uad6c\ubb38\uc744 \uc791\uc131\ud558\uc138\uc694. \\n\\n- http\uc640 dns \ud328\ud0b7\uc744 \ub3d9\uc2dc \ucea1\uccd0 `tcp port 80 or udp port 53`\\n- \ubaa9\uc801\uc9c0 IP\uc8fc\uc18c\uac00 10.10.10.10 \uc774\uba74\uc11c telnet \ud328\ud0b7\ub9cc \ucea1\uccd0 `ip dst 10.10.10.10 and tcp port 23`\\n- icmp ttl \uc5d0\ub7ec\ub9cc \ucea1\uccd0 `icmp[0]=11 and icmp[1]=0`\\n\\n### \uc804\uc5ed\ud658\uacbd\uc124\uc815 \uc704\uce58\uc5d0 \uc874\uc7ac\ud558\ub294 \ud30c\uc77c\ub85c \uc5c5\uadf8\ub808\uc774\ub4dc\uc2dc \ubcf5\uc0ac\ubcf8\uc744 \ub9cc\ub4e4\uc5b4\uc57c \ud558\ub294 \ud30c\uc77c\uc744 \uc4f0\uc138\uc694.\\n\\n- \uc2e4\uc2dc\uac04 \ucea1\uccd0 \ud544\ud130 cfilters\\n- \ub514\uc2a4\ud50c\ub808\uc774 \ud544\ud130 dfilters\\n- \uceec\ub7ec\ub9c1 \ud544\ud130 colorfilter\\n\\n### \uc2e4\uc2dc\uac04 \ucea1\uccd0\uc2dc \ud30c\uc77c\uc9d1\ud569\uc73c\ub85c \ucd5c\uadfc 10\uac1c \ud30c\uc77c\ub9cc \uc0dd\uc131\uc744 \uc720\uc9c0\ud560 \uc218 \uc788\ub294 \uc124\uc815\uc740 \ubb34\uc5c7\uc778\uac00\uc694?\\n\\n\ub9c1\ubc84\ud37c"},{"id":"\uc640\uc774\uc5b4\uc0e4\ud06c","metadata":{"permalink":"/blog/\uc640\uc774\uc5b4\uc0e4\ud06c","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-11-28-KOSTA2/index.md","source":"@site/blog/2023-11-28-KOSTA2/index.md","title":"\uc640\uc774\uc5b4\uc0e4\ud06c","description":"---","date":"2023-11-28T00:00:00.000Z","formattedDate":"November 28, 2023","tags":[{"label":"KOSTA","permalink":"/blog/tags/kosta"},{"label":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/tags/\uc640\uc774\uc5b4\uc0e4\ud06c"}],"readingTime":3.365,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"\uc640\uc774\uc5b4\uc0e4\ud06c","title":"\uc640\uc774\uc5b4\uc0e4\ud06c","authors":["kihyun"],"tags":["KOSTA","\uc640\uc774\uc5b4\uc0e4\ud06c"]},"prevItem":{"title":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/\uc640\uc774\uc5b4\uc0e4\ud06c"},"nextItem":{"title":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/\uc640\uc774\uc5b4\uc0e4\ud06c"}},"content":"---\\n\\n## \ubb38\uc81c\\n---\\n\\n### PDU\\n\\n- L1> bits\\n- L2> frame\\n- L3> packet\\n- L4> segement\\n- L5~L7> message, data stream\\n\\n### \uce90\uc2dc \ud655\uc778 \ubc0f \uc0ad\uc81c\\n\\n- MAC\\n\\n```bash title=\'\ucd94\uac00\'\\narp -a\\n```\\n\\n```bash title=\'\uc0ad\uc81c\'\\narp -d\\n```\\n\\n- DNS\\n\\n```bash title=\'\ucd94\uac00\'\\nipconfig/displaydns\\n```\\n\\n```bash title=\'\uc0ad\uc81c\'\\nipconfig/flushdns\\n```\\n\\n- NetBIOS\\n\\n```bash title=\'\ucd94\uac00\'\\nnbtstat -c\\n```\\n\\n```bash title=\'\uc0ad\uc81c\'\\nnbtstat -R\\n```\\n\\n### OSI \\n\\nMAC\uc8fc\uc18c \ud3ec\ud568 : L2 - datalink layer\\nIP\uc8fc\uc18c \ud3ec\ud568 : L3 - network layer\\n\\n### \uae30\ubcf8 \ucd5c\ub300 \ud06c\uae30\\nEthernet Frame : 1518 Byte\\nMTU : 1500 byte \ud06c\uae30\ubcc0\uacbd \uac00\ub2a5\\nMSS : 1460 byte\\n\\n\\n## \ubaa9\uc801\uc9c0 IP\uc8fc\uc18c\uc5d0 \ub300\ud55c MAC\uc8fc\uc18c\ub97c \ucc3e\uc544\uc624\ub294 \ud504\ub85c\ud1a0\ucf5c\\n\\narp\\n\\n### TCP \ud5e4\ub354\uc5d0\uc11c Flag 6\uac1c\\n\\nsyn,ack,fin,rst,psh,urg\\n\\n###  TCP/IP\uc5d0\uc11c \uc5f0\uacb0\uc0c1\ud0dc\ub97c \ud655\uc778\ud558\uace0 \uc5d0\ub7ec\uba54\uc138\uc9c0\ub97c \uc804\ub2ec\ud558\ub294 \ud504\ub85c\ud1a0\ucf5c\\n\\nicmp\\n\\n### \uc2a4\uc704\uce58 \uae30\ubcf8 \uae30\ub2a5\\n\\nflooding, learning, fowarding, filtering\\n\\n\\n\\n## \uc640\uc774\uc5b4\uc0e4\ud06c\\n---\\n\\n### \ubcd1\ud569\\n\\n\uc640\uc774\uc5b4\uc0e4\ud06c\uc5d0 \uc77c\uc2dc\uc911\uc9c0 \uae30\ub2a5\uc740 \uc5c6\ub2e4 \uc815\uc9c0 \uc774\ud6c4 \ub2e4\uc2dc \ucea1\uccd0\ud574\uc11c \ubcd1\ud569\ud558\ub294 \ubc29\ubc95\ubc16\uc5d0 \uc5c6\ub2e4.\\n\\n\ubcd1\ud569\uc740 \ud30c\uc77c > \ubcd1\ud569\uc5d0\uc11c \uac00\ub2a5\\n\\n\uc640\uc774\uc5b4\uc0e4\ud06c\ub294 \ub450\uac1c\uc758 \ud30c\uc77c\uc744 \ub3d9\uc2dc\uc5d0 \uc5f4 \uc218 \uc5c6\uc5b4\uc11c \ubcd1\ud569\uc744 \uc0ac\uc6a9\ud55c\ub2e4.\\n\\n\ubcd1\ud569\uc5d0\ub294 3\uac00\uc9c0 \uc635\uc158\uc774 \uc788\ub294\ub370 \uae30\ubcf8\uac12\uc740 \uc2dc\uac04 \uae30\uc900\uc73c\ub85c \ubcd1\ud569\ud558\ub294 \uac83\uc774\uace0 \uc804\uc5d0 \uc774\uc5b4\ubd99\uc774\uae30 \ud6c4\uc5d0 \uc774\uc5b4\ubd99\uc774\uae30\uac00 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n### \ucea1\ucc98 \ud30c\uc77c\\n\\n\uc5f4\uae30 \ud3f4\ub354 \ubc84\ud2bc\uc73c\ub85c \ud30c\uc77c\uc744 \uc5f0\ub2e4\uba74 \ucea1\ucc98 \uc2dc\uac04\uacfc \uc0ac\uc774\uc988 \ub4f1\uc744 \ucd94\uac00\ub85c \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n\\n### \uc0c8\ub85c\uace0\uce68 \ubc84\ud2bc\\n\\n\uc640\uc774\uc5b4\uc0e4\ud06c\ub294 time \uce7c\ub7fc\uc758 \uc791\ub3d9\ubc29\uc2dd\uc774 \uc9c0\uc5f0 \uc2dc\uac04 \uc791\ub3d9\ubc29\uc2dd\uc744 \ucc44\ud0dd\ud55c\ub2e4.\\n\\n\\n\uadf8\ub798\uc11c 1\ubc88 \ud328\ud0b7\uc774 0.00\ucd08\uc774\uace0 \uadf8\ub2e4\uc74c \ubd80\ud130\ub294 1\ubc88 \ud328\ud0b7 \uc774\ud6c4 \ucea1\uccd0\ub41c \uc9c0\uc5f0 \uc2dc\uac04\uc774\ub2e4.\\n\\n\uadf8\ub7f0\ub370 10\ubc88 \ud328\ud0b7\uc744 0\ucd08\ub85c \uc124\uc815\ud558\ub294 \ubc29\ubc95\uc774 \uc788\ub294\ub370 `\uc2dc\uac04 \ucc38\uc870 \uc124\uc815`\uc744 \ud558\uba74 \ud560 \uc218 \uc788\ub2e4.\\n\\n`\uc2dc\uac04 \ucc38\uc870 \uc124\uc815`\uc740 \ud558\ub098\uc5d0\ub9cc \ud560 \uc218 \uc788\ub294 \uac83\uc774 \uc544\ub2cc\ub370 \uadf8\ub798\uc11c \ub098\uc911\uc5d0 \ud480\uc5b4\uc8fc\ub824\uace0 \ud558\uba74 \ub108\ubb34 \uc5b4\ub835\ub2e4.\\n\\n\uc774 \ub54c `\ud30c\uc77c \ub2e4\uc2dc \ubd88\ub7ec\uc624\uae30` \ubc84\ud2bc\uc774 \uc774\ub97c \ubaa8\ub450 \ud574\uc81c\ud574\uc900\ub2e4.\\n\\n\uadf8\ub798\uc11c `\ud30c\uc77c \ub2e4\uc2dc \ubd88\ub7ec\uc624\uae30` \ubc84\ud2bc\uc744 \uc790\uc8fc \uc0ac\uc6a9\ud55c\ub2e4\uace0 \ud55c\ub2e4.\\n\\n\\n### \uc774\ub984 \ud574\uc11d\\n\\n\ubcf4\uae30 > \uc774\ub984\ud574\uc11d > \ub124\ud2b8\uc6cc\ud06c \uc8fc\uc18c \ud574\uc11d\uc744 \ud0a4\uba74 \ud328\ud0b7\uc758 IPv4\uc5d0\uc11c dns \uc8fc\uc18c\ub85c \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n\uadfc\ub370 \uc774\ub7ec\uba74 \uc4f8\ub370\uc5c6\ub294 UDP \ud328\ud0b7\uc774 \uc0dd\uae30\uae30 \ub54c\ubb38\uc5d0 \uc2e4\uc2dc\uac04 \ud328\ud0b7\uc744 \ucea1\uccd0\ud560 \ub54c \uc774\ub984 \ud574\uc11d\uc744 \ud574\uc81c\ud558\uace0 \ud558\ub294 \uac83\uc774 \uc88b\ub2e4.\\n\\n\ubcf4\uae30 > \uc774\ub984\ud574\uc11d > \uc804\uc1a1\uc8fc\uc18c \ud574\uc11d\uc744 \ud0a4\uba74 \ud3ec\ud2b8 \ubc88\ud638\uc5d0 \uc774\ub984\uc744 \ubd99\uc5ec\uc90c\\n\\n\\n:::tip \uc774\ub984 \ud574\uc11d \ucee4\uc2a4\ud140\\n`MAC addr`  c:\\\\program files\\\\wireshark\\\\ethers\\n`IP addr`   c:\\\\program files\\\\wireshark\\\\hosts\\n`port name` c:\\\\program files\\\\wireshark\\\\services\\n:::"},{"id":"\uc640\uc774\uc5b4\uc0e4\ud06c","metadata":{"permalink":"/blog/\uc640\uc774\uc5b4\uc0e4\ud06c","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-11-27-KOSTA1/index.md","source":"@site/blog/2023-11-27-KOSTA1/index.md","title":"\uc640\uc774\uc5b4\uc0e4\ud06c","description":"---","date":"2023-11-27T00:00:00.000Z","formattedDate":"November 27, 2023","tags":[{"label":"KOSTA","permalink":"/blog/tags/kosta"},{"label":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/tags/\uc640\uc774\uc5b4\uc0e4\ud06c"}],"readingTime":5.6,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"\uc640\uc774\uc5b4\uc0e4\ud06c","title":"\uc640\uc774\uc5b4\uc0e4\ud06c","authors":["kihyun"],"tags":["KOSTA","\uc640\uc774\uc5b4\uc0e4\ud06c"]},"prevItem":{"title":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/\uc640\uc774\uc5b4\uc0e4\ud06c"},"nextItem":{"title":"PKI \uac1c\ub150","permalink":"/blog/PKI"}},"content":"---\\n\\n## \uc640\uc774\uc5b4\uc0e4\ud06c \uc124\uce58\\n---\\n\\n[\uc774\uacf3](https://www.wireshark.org/)\uc5d0\uc11c \uc9c4\ud589\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n## \ucef4\ud4e8\ud130 \ub124\ud2b8\uc6cc\ud06c\\n---\\n\\n\ub370\uc774\ud130 \ud1b5\uc2e0\uc740 MAC\uc8fc\uc18c\uac00 \uaf2d \ud544\uc694\ud568. \uc774\uac78 \ub17c\ub9ac\uc801\uc73c\ub85c \ubc14\uafbc \uc8fc\uc18c\uac00 IP\uc8fc\uc18c\\n\\n### \ubb3c\ub9ac\uc8fc\uc18c \ud655\uc778\\n\\n```bash\\narp -a\\n```\\n\\n\uce90\uc2dc \ub370\uc774\ud130\ub2e4. 5\ubd84\ub4a4\uc5d0 \uc9c0\uc5b4\uc9d0 \uadfc\ub370 \uc9c0\uc6b0\ub824\uba74\\n\\n```bash\\napr -d\\n```\\n\\n\uce90\uc2dc\uac00 \ub0a8\ub294\uacbd\uc6b0\ub294 \ub0b4\uac00 \uc0c1\ub300\ubc29\uacfc \uc5f0\uacb0\uc744 \ud560 \ub54c\ub3c4 \uc788\uc9c0\ub9cc \uc0c1\ub300\ubc29\uc774 \ub098\uc640 \uc5f0\uacb0\ud560 \ub54c\ub3c4 \uce90\uc2dc\uac00 \ub0a8\uc74c.\\n\\n\uadf8\ub798\uc11c \ud328\ud0b7 \ubd84\uc11d\ud560 \ub54c \uce90\uc2dc\ub97c \uc9c0\uc6cc\uc57c \ud55c\ub2e4.\\n\\n\\n### dns\uac00 \uc54c\ub824\uc900 ip \uce90\uc2dc \uc815\ubcf4 \ud655\uc778\\n---\\n\\n```bash\\nipconfig/displaydns\\n```\\n\\n\uc9c0\uc6b0\uae30\\n\\n```bash\\nipconfig/flushdns\\n```\\n\\n### \ucef4\ud4e8\ud130 \uc774\ub984\uc73c\ub85c \ud1b5\uc2e0\\n---\\n\\n```bash\\nnbtstat -n\\n```\\n\\n\uce90\uc2dc \ud655\uc778\\n\\n```bash\\nnbtstat -c\\n```\\n\\n\uce90\uc2dc \uc0ad\uc81c\\n\\n```bash\\nnbtstat -R\\n```\\n\\n\ubd84\uc11d\ud560 \ub54c arp, dns, nbtstat \uce90\uc2dc \uc9c0\uc6cc\uc8fc\uace0 \ud558\ub294\uac8c \uc88b\ub2e4.\\n\\n\\n\\n### OSI 7 \uacc4\uce35\\n\\n\uacc4\uce35\uc744 \ud1b5\uacfc\ud560 \ub54c\ub294 \uad00\ub828 \ud5e4\ub354\uac00 \ucd94\uac00\ub41c\ub2e4. PDU\uac00 \uc788\ub2e4.\\n\\nPDU\ub294 \uc544\ub798 \uc815\ub9ac..\\n\\n`Presentation` : Message\\n\\n`Transport` : Segment\\n\\n`Network` : packet\\n\\n`Datalink` : frame\\n\\n---\\n\\n`Application` : \ud1b5\uc2e0 software\\n\\n`Presentation` : \ub370\uc774\ud130 \ud3ec\ub9f7 \uc815\uc758 (jpg,png \ub4f1)\\n\\n`Session` : App \uc5f0\uacb0 \uc720\uc9c0 or \ud574\uc81c\\n\\n`Transport` : \ud328\ud0b7 \ubd84\ub9ac, \uc7ac\uc804\uc1a1, \uc5d0\ub7ec \uac80\ucd9c (Segment\uac00 \uc804\uc1a1 \ucd5c\uc18c\ub2e8\uc704\uc5ec\uc11c)\\n\\n`Network` : Segment\uc55e\uc5d0 \ub17c\ub9ac\uc801 \uc8fc\uc18c(IP)\ub97c \ucd94\uac00\ud574\uc11c \ubaa9\uc801 \uc804\ub2ec \uac00\ub2a5\ud558\uac8c \ud574\uc90c > Packet\\n\\n`Datalink` : \ubb3c\ub9ac \uc8fc\uc18c\ub97c \ucd94\uac00\ud574\uc11c \uc804\ub2ec(MAC,DLCI) > Frame\\n\\n`Pyhsical` : bit\ub97c \uc804\uae30\uc2e0\ud638\ub85c \ubcc0\ud658, \uc804\uae30\uc801, \uae30\ub2a5\uc801 \ud2b9\uc131, \uc808\ucc28\uc801 \ud2b9\uc131, \uae30\uacc4\uc801 \ud2b9\uc131\uc5d0 \ub300\ud55c \uc57d\uc18d\\n\\n\\n### TCP/IP 4 \uacc4\uce35\\n\\n`Application` : osi\uc758 application, presentation, session\uc744 \ud569\uce5c \uacc4\uce35, http, telnet, dns, dhcp \ud504\ub85c\ud1a0\ucf5c\uc774 \uc788\uc74c\\n\\n`Transport` : TCP,UDP \ud504\ub85c\ud1a0\ucf5c\uc774 \uc788\uc74c\\n\\n    + \ud3ec\ud2b8\ubc88\ud638\ub97c \ud1b5\ud574\uc11c Application \uc5b4\ub514\ub85c \ubcf4\ub0bc\uc9c0 \ub2f4\uaca8\uc788\uc74c\\n\\n\\n`Internet` : OSI\uc758 network \uacc4\uce35, ICMP, IP, ARP RARP \uc788\ub2e4. \\n    \\n    + protocol Number \ub97c \ud1b5\ud574\uc11c TCP,UDP.. \ub4f1 \uc5b4\ub514\ub85c \ub118\uae30\uc9c0 \ub2f4\uaca8\uc788\uc74c\\n\\n`network access` : OSI\uc758 datalink, physical \uacc4\uce35 ethernet2(MAC) \\n    \\n    + Type(IPv4, IPv6)\uc774 \uc778\ud130\ub137 \uacc4\uce35 \ud504\ub85c\ud1a0\ucf5c \uc5b4\ub514\ub85c \ubcf4\ub0bc\uc9c0 \uad6c\ubd84\ud574\uc90c \\n\\n![Alt text](image.png)\\n\\n\\n### \ud3ec\ud2b8\ubc88\ud638\\n\\n`0 ~ 1023` : \uc798 \uc54c\ub824\uc9c4 \uc11c\ube44\uc2a4 \uc608\uc57d \ud3ec\ud2b8\\n\\n`1024 ~ 49151` : \ucd94\uac00 \ud45c\uc900 \uc0c1\uc6a9 tool \uc608\uc57d \ud3ec\ud2b8\\n\\n`49152 ~ 65535` : \uac1c\uc778\uc6a9 \ud3ec\ud2b8\\n\\n\\n:::tip\\n[\ub3c4\uc6c0\uc774 \ub418\ub294 \ub2e4\uc591\ud55c \uc815\ubcf4\ub4e4\uc774 \ub2f4\uae34 url 1](https://www.iana.org/assignments/protocol-numbers/protocol-numbers.xhtml)  \\n[\ub3c4\uc6c0\uc774 \ub418\ub294 \ub2e4\uc591\ud55c \uc815\ubcf4\ub4e4\uc774 \ub2f4\uae34 url 2](https://www.iana.org/assignments/service-names-port-numbers/service-names-port-numbers.xhtml)\\n:::\\n\\n\\n### \ub124\ud2b8\uc6cc\ud06c \uc5f0\uacb0 \uc7a5\uce58\\n\\n1. HUB\\n\\n\ud5c8\ube0c\ub294 \ub2e4 \ud655\uc778\ud574\ubcf4\uace0 \ud574\ub2f9 \ubaa9\uc801\uc9c0\uc778\uc9c0 \uac80\uc0ac\ud558\uace0 \uc544\ub2c8\uba74 \ub2e4\uc74c \ubaa9\uc801\uc9c0\ub85c.. \ubc18\ubcf5\\n\\n2. Switch\\n\\n\uc2a4\uc704\uce58\ub294 \ubaa9\uc801\uc9c0 \uc8fc\uc18c\uac00 \ud3ec\ud568\ub418\uc5b4 \uc788\uc5b4\uc11c \ud574\ub2f9 \ubaa9\uc801\uc9c0\uc5d0\ub9cc \ubc29\ubb38 \uadfc\ub370 FFFF\uac00 \ubaa9\uc801\uc9c0 \uc8fc\uc18c\uc774\uba74 \ube0c\ub85c\ub4dc\uce90\uc2a4\ud2b8 \uc778\ub370 \ubaa8\ub4e0 \uc2a4\uc704\uce58\uc5d0 \uc804\ub2ec(Flooding)\ud558\uae30 \ub54c\ubb38\uc5d0 \ub124\ud2b8\uc6cc\ud06c \ubd80\ud558\uac00 \uc634 > \ucc28\ub2e8\uc758 \ud544\uc694\uc131\uc774 \uc788\ub2e4.\\n\\n:::tip \uc2a4\uc704\uce58 \ub3d9\uc791\\n1. Flooding\\n\\n\ub4e4\uc5b4\uc628 \ud3ec\ud2b8\ub97c \uc81c\uc678\ud558\uace0 \ubaa8\ub4e0 \ud3ec\ud2b8\uc5d0 \ubfcc\ub9bc\\n\\n2. Learning\\n\\n\ub9e5\uc8fc\uc18c\ub97c \ud559\uc2b5\ud574\uc11c \ub9e5 \ud14c\uc774\ube14\uc5d0 \uc791\uc131\\n\\n3. Forwarding\\n\\n\ubaa9\uc801\uc9c0 \ub9e5\uc8fc\uc18c\uc5d0 \uadf8\ub300\ub85c \ud504\ub808\uc784 \ubcf4\ub0b4\ub294 \uac83\\n\\n4. Filtering\\n\\n\ubaa9\uc801\uc9c0 \uc8fc\uc18c\ub97c \uc54c\uace0 \uc788\uc744 \ub54c \ud504\ub808\uc784 \uc804\uc1a1\uc744 \ub9c9\ub294 \uac83\\n\\n:::\\n\\n\\n3. Router\\n\\n\ub77c\uc6b0\ud130\ub294 \ub124\ud2b8\uc6cc\ud06c \ubcc4\ub85c \uc804\uc1a1 \ucc28\ub2e8\ud560 \uc218 \uc788\uc74c. \ube0c\ub85c\ub4dc\uce90\uc2a4\ud2b8\ub85c \uc778\ud55c \ub124\ud2b8\uc6cc\ud06c \ubd80\ud558 \ubc29\uc9c0\\n\\n### TCP\uc640 UDP\\n\\n`TCP` : \ud5e4\ub354(20 ~ 60byte)\\n\\nA >> \ud655\uc778\uc2e0\ud638 >> B\\n\\nB >> \uc751\ub2f5 >> A\\n\\nA >> \uc5f0\uacb0 \ud655\uc815 >> B\\n\\nA >> \ub370\uc774\ud130 \uc804\ub2ec >> B\\n\\nB >> \uc751\ub2f5 >> A\\n\\n`UDP` : \ud5e4\ub354 (8byte)\\n\\nA >> \ub370\uc774\ud130 \uc804\ub2ec >> B\\n\\n## wireshark\\n---\\n\\n\uc640\uc774\uc5b4\uc0e4\ud06c\ub294 \ub9c8\uc9c0\ub9c9 \uc0c1\ud0dc \uc124\uc815\uc774 \uc800\uc7a5\ub41c\ub2e4.\\n\\n\\n\\n\ucea1\ucc98 \uc635\uc158\uc5d0\uc11c \ubaa8\ub450 \ubb34\uc791\uc704\ub97c \ub044\uba74 \ub098\ud55c\ud14c \ub4e4\uc5b4\uc624\ub294 \ud328\ud0b7\ub9cc \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n### \uc228\uae40\\n\\n\ucea1\ucc98 > \uc635\uc158 > \uc778\ud130\ud398\uc774\uc2a4\uad00\ub9ac\uc5d0\uc11c \ud45c\uc2dc\ub97c \uccb4\ud06c \ud574\uc81c\ud558\uba74 \uc778\ud130\ud398\uc774\uc2a4\ub97c \uc228\uae38 \uc218 \uc788\ub2e4.\\n\\n\uc544\ub2c8\uba74 \ub124\ud2b8\uc6cc\ud06c \uc124\uc815\uc5d0\uc11c \uc5b4\ub311\ud130 \uc0ac\uc6a9\uc548\ud558\uba74 \uc548\ubcf4\uc784\\n\\n\uc544\ub2c8\uba74 \ub77c\uc774\ube0c\ub7ec\ub9ac(npcap)\uac00 \uc0ad\uc81c\ub410\uc744 \uc218\ub3c4 \uc788\uc74c.\\n\\n\uc544\ub2c8\uba74 \uac00\uc0c1 \uc778\ud130\ud398\uc774\uc2a4\ub97c \ucd94\uac00\ud558\uace0 \uc7ac\ubd80\ud305\ud574\uc57c \ubcf4\uc784\\n\\n\\n### \ud1b5\uacc4\\n\\n\ud544\ud130\uc5d0 `tcp.stream == 1` \ub4f1\uc73c\ub85c \ud544\ud130\ub9c1 \ud6c4\\n\\n\ud1b5\uacc4 > \ud50c\ub85c \uadf8\ub798\ud504 > \ud45c\uc2dc \ud544\ud130\ub85c \uc81c\ud55c\\n\\n![Alt text](image-1.png)\\n\\n\\n### \uc2a4\ud2b8\ub9bc \ud655\uc778\\n\\n\ud328\ud0b7\uc5d0 \uc6b0\ud074\ub9ad > \ub530\ub77c\uac00\uae30 > TCP \uc2a4\ud2b8\ub9bc \ub4f1..\\n\\n\ud55c \ub208\uc5d0 \ubcf4\uc778\ub2e4.\\n\\nTCP\ub294 \ucd5c\ub300 \uae38\uc774\uac00 1514\uc5ec\uc11c \uc798\ub824\uc11c \ubd84\uc11d\ud558\uae30 \uc5b4\ub824\uc6b8 \uc218 \uc788\ub294\ub370 \ud55c \ub208\uc5d0 \ud655\uc778 \uac00\ub2a5"},{"id":"PKI","metadata":{"permalink":"/blog/PKI","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-10-25-pki/index.md","source":"@site/blog/2023-10-25-pki/index.md","title":"PKI \uac1c\ub150","description":"PKI\ub780 Public Key Infrastructure\uc758 \uc57d\uc790\ub85c \uacf5\uac1c\ud0a4 \uc554\ud638\ud654\uc640 \uc804\uc790\uc11c\uba85\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\uac8c \uae30\ubc18\uc744 \ub9c8\ub828\ud574\ub454 \uac83\uc774\ub77c\uace0 \ud569\ub2c8\ub2e4.","date":"2023-10-25T00:00:00.000Z","formattedDate":"October 25, 2023","tags":[{"label":"pki","permalink":"/blog/tags/pki"}],"readingTime":2.46,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"PKI","title":"PKI \uac1c\ub150","authors":["kihyun"],"tags":["pki","PKI"]},"prevItem":{"title":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/\uc640\uc774\uc5b4\uc0e4\ud06c"},"nextItem":{"title":"Overloading & Overriding","permalink":"/blog/Overloading and Overriding"}},"content":"PKI\ub780 Public Key Infrastructure\uc758 \uc57d\uc790\ub85c \uacf5\uac1c\ud0a4 \uc554\ud638\ud654\uc640 \uc804\uc790\uc11c\uba85\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\uac8c \uae30\ubc18\uc744 \ub9c8\ub828\ud574\ub454 \uac83\uc774\ub77c\uace0 \ud569\ub2c8\ub2e4.\\n\\n\\n\uc2e0\ub8b0\uae30\uac04\uc774 \uacf5\uac1c\ud0a4\ub4e4\uc744 \uc778\uc99d\ud574\uc8fc\uba74 \uadf8 \uacf5\uac1c\ud0a4\uc5d0 \ub300\uc751\ub418\ub294 \uac1c\uc778\ud0a4\ub3c4 \uc778\uc99d\ub418\uae30 \ub54c\ubb38\uc5d0 \uac1c\uc778\ud0a4\ub97c \uac16\uace0 \uc788\ub294 \uac1c\uc778\uc774 \uc778\uc99d\uc744 \ubc1b\uc2b5\ub2c8\ub2e4.\\n\\n\\n## \uc740\ud589\uc5d0\uc11c \uacf5\uc778\uc778\uc99d\uc11c \uc778\uc99d \uacfc\uc815\\n---\\n\\n\uc740\ud589\uc5d0\uc11c \uacf5\uc778\uc778\uc99d\uc11c \uacfc\uc815\ub97c \uc778\uc99d\ud558\ub294 \uacfc\uc815\uc774 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n![Alt text](image.png)\\n\\n### \uc0dd\uc131 \uacfc\uc815\\n\\n1. \uba3c\uc800 \uac1c\uc778\uc774 \uacf5\uc778 \uc778\uc99d\uc11c \ubc1c\uae09\uc744 CA\uc5d0 \uc694\uccad\ud569\ub2c8\ub2e4.\\n\\n2. \uadf8\ub7ec\uba74 CA\uc5d0\uc11c \uac1c\uc778\uc758 \uac1c\uc778\ud0a4, \uacf5\uac1c\ud0a4\ub97c \uc0dd\uc131\ud569\ub2c8\ub2e4.\\n\\n3. \uc0dd\uc131\ud55c \ud0a4\ub4e4\ub85c \ub514\uc9c0\ud138 \uc778\uc99d\uc11c\ub97c \ubc1c\uae09\ud569\ub2c8\ub2e4.\\n\\n:::tip \ub514\uc9c0\ud138 \uc778\uc99d\uc11c\uc5d0 \ub4e4\uc5b4\uac00\ub294 \uac83\\n`\ubc1c\uae09\uc790 \uc815\ubcf4`,  `\uc18c\uc720\uc790 \uc815\ubcf4`, `\uc778\uc99d\uc11c \uad8c\ud55c`, `\uc720\ud6a8\uae30\uac04`, `\ubc1c\uae09\uc790 \uc804\uc790 \uc11c\uba85`, `\uc77c\ub828\ubc88\ud638`, `\uc18c\uc720\uc790 \uacf5\uac1c\ud0a4 \uc815\ubcf4`\\n:::\\n\\n4. \ub514\uc9c0\ud138 \uc11c\uba85 \uc0dd\uc131\uc744 \uc0dd\uc131\ud569\ub2c8\ub2e4.\\n\\n\ub514\uc9c0\ud138 \uc11c\uba85\uc740 \uc804\uc1a1\ud560 \ubb38\uc11c\ub97c \uc778\uc99d\ud574\uc8fc\ub294 \ub3c4\uad6c\uc785\ub2c8\ub2e4.\\n\\n:::tip \ub514\uc9c0\ud138 \uc11c\uba85 \uc0dd\uc131 \uc808\ucc28\\n1. \uba54\uc2dc\uc9c0 or \ubb38\uc11c \uc120\ud0dd\\n2. \uba54\uc2dc\uc9c0 or \ubb38\uc11c\uc5d0 \ud574\uc2dc \ud568\uc218 \uc801\uc6a9 > `\ud574\uc2dc \uac12`\\n3. \uc0ac\uc6a9\uc790\uc758 \uac1c\uc778\ud0a4\ub85c `\ud574\uc2dc \uac12` \uc554\ud638\ud654 > `\ub514\uc9c0\ud138 \uc11c\uba85`\\n:::\\n\\n\\n### \ud655\uc778 \uacfc\uc815\\n\\n1. `\uc6d0\ubcf8 \uba54\uc2dc\uc9c0`\uc640 `\ub514\uc9c0\ud138 \uc11c\uba85`\uc744 \ubc1b\uc2b5\ub2c8\ub2e4.\\n\\n2. \ub514\uc9c0\ud138 \uc778\uc99d\uc11c\uc5d0\uc11c \ucd94\ucd9c\ud55c \uacf5\uac1c\ud0a4\ub85c `\ub514\uc9c0\ud138 \uc11c\uba85`\uc744 \ubcf5\ud638\ud654\ud569\ub2c8\ub2e4. > `\ud574\uc2dc \uac12`\\n\\n3. `\uc6d0\ubcf8 \uba54\uc2dc\uc9c0` \ud574\uc2dc\ud574\ubcf4\uba70 \ubcf5\ud638\ud654\ud55c `\ud574\uc2dc \uac12`\uacfc \ub3d9\uc77c\ud55c\uc9c0 \ud655\uc778\ud558\uc5ec \ubb34\uacb0\uc131 \uac80\uc0ac\ub97c \ud569\ub2c8\ub2e4.\\n\\n4. \ub514\uc9c0\ud138 \uc778\uc99d\uc11c\uc758 \uc720\ud6a8\uae30\uac04\uc744 \ud655\uc778\ud569\ub2c8\ub2e4.\\n\\n\uadf8\ub7ec\uba74 PKI \uc778\uc99d\uc774 \ub429\ub2c8\ub2e4. \uc5ec\uae30\uc11c \uc740\ud589\uacfc \ud1b5\uc2e0\ud558\uace0 \uc2f6\ub2e4\uba74 \uba54\uc2dc\uc9c0 \ub610\ub294 \ubb38\uc11c\uac00 \uc740\ud589\uc758 \uc778\uc99d\uc11c\uac00 \ub418\uaca0\ub124\uc694."},{"id":"Overloading and Overriding","metadata":{"permalink":"/blog/Overloading and Overriding","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-09-16-over/index.md","source":"@site/blog/2023-09-16-over/index.md","title":"Overloading & Overriding","description":"\uc624\ubc84\ub85c\ub529\uacfc \uc624\ubc84\ub77c\uc774\ub529\uc5d0 \ub300\ud574\uc11c \uc54c\uc544\ubcf4\uaca0\uc2b5\ub2c8\ub2e4.","date":"2023-09-16T00:00:00.000Z","formattedDate":"September 16, 2023","tags":[{"label":"Overriding","permalink":"/blog/tags/overriding"},{"label":"Overloading","permalink":"/blog/tags/overloading"},{"label":"\uc624\ubc84\ub85c\ub529","permalink":"/blog/tags/\uc624\ubc84\ub85c\ub529"},{"label":"\uc624\ubc84\ub77c\uc774\ub529","permalink":"/blog/tags/\uc624\ubc84\ub77c\uc774\ub529"}],"readingTime":3.87,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"Overloading and Overriding","title":"Overloading & Overriding","authors":["kihyun"],"tags":["Overriding","Overloading","\uc624\ubc84\ub85c\ub529","\uc624\ubc84\ub77c\uc774\ub529"]},"prevItem":{"title":"PKI \uac1c\ub150","permalink":"/blog/PKI"},"nextItem":{"title":"[SOLID] \uac1d\uccb4 \uc9c0\ud5a5 \ud504\ub85c\uadf8\ub798\ubc0d(OOP) \uc6d0\uce59","permalink":"/blog/design pattern rule"}},"content":"\uc624\ubc84\ub85c\ub529\uacfc \uc624\ubc84\ub77c\uc774\ub529\uc5d0 \ub300\ud574\uc11c \uc54c\uc544\ubcf4\uaca0\uc2b5\ub2c8\ub2e4.\\n\\n## \uc624\ubc84\ub85c\ub529 (Overloading)\\n\\n### \uc815\uc758\\n\\n\ud55c \ud074\ub798\uc2a4 \ub0b4\uc5d0 \uc774\ubbf8 **\uc0ac\uc6a9\ud558\ub824\ub294 \uc774\ub984**\uacfc **\uac19\uc740 \uc774\ub984**\uc744 \uac00\uc9c4 **`\uba54\uc18c\ub4dc`**\uac00 \uc788\uc5b4\ub3c4 \ub9e4\uac1c \ubcc0\uc218\uc758 \uac1c\uc218\uc640 \ud0c0\uc785\uc774 \ub2e4\ub974\uba74 \uac19\uc740 \uc774\ub984\uc744 \uc0ac\uc6a9\ud574\uc11c \uba54\uc18c\ub4dc\ub97c \uc7ac\uc815\uc758 \ud560 \uc218 \uc788\ub2e4.\\n\\n\uc5ec\uae30\uc11c \ud575\uc2ec\uc740 2\uac00\uc9c0\ub85c \uc815\ub9ac\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n1. \uba54\uc18c\ub4dc\uc758 \uc774\ub984\uc774 \uac19\ub2e4.\\n2. \ub9e4\uac1c\ubcc0\uc218\uc758 \uac1c\uc218\ub098 \ud0c0\uc785\uc774 \ub2ec\ub77c\uc57c \ud55c\ub2e4.\\n3. \ub9ac\ud134\uac12\uacfc\ub294 \uc0c1\uad00 \uc5c6\uc2b5\ub2c8\ub2e4.\\n\\n\\n### \uc624\ubc84\ub85c\ub529 \ud568\uc218 \ucf54\ub4dc\\n\\n```java title=\'\uc624\ubc84\ub85c\ub529 \ud568\uc218\'\\npublic class OverringClass {\\n    \\n    // \uc624\ubc84\ub85c\ub529 1\ubc88 \ud568\uc218\\n    public void OverloadMethod(){\\n        System.out.println(\\"============================\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \uc218 : 0\uac1c\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : void\\");\\n        System.out.println(\\"\uc624\ubc84\ub77c\uc774\ub529 1\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4.\\");\\n        System.out.println(\\"============================\\");\\n    }\\n\\n    // \uc624\ubc84\ub85c\ub529 2\ubc88 \ud568\uc218\\n    public int OverloadMethod(int a, int b){\\n        System.out.println(\\"============================\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \uc218 : 2\uac1c\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : int\\");\\n        System.out.println(\\"\uc624\ubc84\ub77c\uc774\ub529 2\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \ub367\uc148 \uac12\uc744 \ubc18\ud658\ud569\ub2c8\ub2e4.\\");\\n        System.out.println(\\"============================\\");\\n\\n        return a+b;\\n    }\\n\\n    // \uc624\ubc84\ub85c\ub529 3\ubc88 \ud568\uc218\\n    public int OverloadMethod(int a, int b, int c){\\n        System.out.println(\\"============================\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \uc218 : 3\uac1c\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : int\\");\\n        System.out.println(\\"\uc624\ubc84\ub77c\uc774\ub529 3\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \uacf1\uc148\uc744 \ubc18\ud658\ud569\ub2c8\ub2e4.\\");\\n        System.out.println(\\"============================\\");\\n\\n        return a*b*c;\\n    }\\n\\n\\n    // \uc624\ubc84\ub85c\ub529 4\ubc88 \ud568\uc218\\n    public boolean OverloadMethod(String str){\\n        System.out.println(\\"============================\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \uc218 : 1\uac1c\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : String\\");\\n        System.out.println(\\"\uc624\ubc84\ub77c\uc774\ub529 4\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \uc774\ub984\uc774 park\uc774\uba74 true\ub97c \ubc18\ud658\ud569\ub2c8\ub2e4.\\");\\n        System.out.println(\\"============================\\");\\n\\n        if(str.equals(\\"park\\")){\\n            return true;\\n        }else{\\n            return false;\\n        }\\n    }\\n}\\n\\n```\\n\\n\uc704 \ud568\uc218\ub4e4\uc744 \ubcf4\uc2dc\uba74 `OverloadMethod`\ub85c \uc774\ub984\ub4e4\uc774 \uac19\uc9c0\ub9cc \ud0c0\uc785\uacfc \ub9e4\uac1c\ubcc0\uc218\uc758 \uc218\uac00 \ub2e4\ub978 \uac83\ub4e4\uc744 \ubcf4\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ud568\uc218\ub4e4\uc5d0 \ub300\ud55c \uc124\uba85\uc740 \ucf54\ub4dc\uc5d0 \uc791\uc131\ub3fc \uc788\uc73c\ub2c8 \ucc38\uace0\ud574\uc8fc\uc138\uc694~ \ud83d\ude0e\\n\\n\ucf54\ub4dc\ub97c \uc2e4\ud589\ud558\ub294 \ucf54\ub4dc\uc640 \uacb0\uacfc\ub97c \ud655\uc778\ud574\ubcf4\uaca0\uc2b5\ub2c8\ub2e4.\\n\\n``` java title=\'\uacb0\uacfc \ud655\uc778 \ucf54\ub4dc\'\\npublic class Main {\\n    public static void main(String[] args) {\\n        OverringClass oc = new OverringClass();\\n        \\n        // \uc624\ubc84\ub85c\ub529 1\ubc88 \ud568\uc218\\n        oc.OverloadMethod();\\n\\n        // \uc624\ubc84\ub85c\ub529 2\ubc88 \ud568\uc218\\n        int a = oc.OverloadMethod(1,2);\\n        System.out.println(\\"\uc624\ubc84\ub85c\ub529 2\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : \\"+a);\\n\\n        // \uc624\ubc84\ub85c\ub529 3\ubc88 \ud568\uc218\\n        int b = oc.OverloadMethod(4,5,6);\\n        System.out.println(\\"\uc624\ubc84\ub85c\ub529 3\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : \\"+b);\\n\\n        // \uc624\ubc84\ub85c\ub529 4\ubc88 \ud568\uc218\\n        boolean c = oc.OverloadMethod(\\"park\\");\\n        System.out.println(\\"\uc624\ubc84\ub85c\ub529 4\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : \\"+c);\\n    }\\n}\\n```\\n\\n```text title=\'\uacb0\uacfc\'\\n============================\\n\ub9e4\uac1c\ubcc0\uc218 \uc218 : 0\uac1c\\n\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : void\\n\uc624\ubc84\ub77c\uc774\ub529 1\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4.\\n============================\\n============================\\n\ub9e4\uac1c\ubcc0\uc218 \uc218 : 2\uac1c\\n\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : int\\n\uc624\ubc84\ub77c\uc774\ub529 2\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \ub367\uc148 \uac12\uc744 \ubc18\ud658\ud569\ub2c8\ub2e4.\\n============================\\n\uc624\ubc84\ub85c\ub529 2\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : 3\\n============================\\n\ub9e4\uac1c\ubcc0\uc218 \uc218 : 3\uac1c\\n\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : int\\n\uc624\ubc84\ub77c\uc774\ub529 3\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \uacf1\uc148\uc744 \ubc18\ud658\ud569\ub2c8\ub2e4.\\n============================\\n\uc624\ubc84\ub85c\ub529 3\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : 120\\n============================\\n\ub9e4\uac1c\ubcc0\uc218 \uc218 : 1\uac1c\\n\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : String\\n\uc624\ubc84\ub77c\uc774\ub529 4\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \uc774\ub984\uc774 park\uc774\uba74 true\ub97c \ubc18\ud658\ud569\ub2c8\ub2e4.\\n============================\\n\uc624\ubc84\ub85c\ub529 4\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : true\\n```"},{"id":"design pattern rule","metadata":{"permalink":"/blog/design pattern rule","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-08-29-rule/index.md","source":"@site/blog/2023-08-29-rule/index.md","title":"[SOLID] \uac1d\uccb4 \uc9c0\ud5a5 \ud504\ub85c\uadf8\ub798\ubc0d(OOP) \uc6d0\uce59","description":"SRP ( \ub2e8\uc77c \ucc45\uc784\uc758 \uc6d0\uce59 : Single Responsibility Principle )","date":"2023-08-29T00:00:00.000Z","formattedDate":"August 29, 2023","tags":[{"label":"design pattern","permalink":"/blog/tags/design-pattern"},{"label":"rule","permalink":"/blog/tags/rule"}],"readingTime":1.925,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"design pattern rule","title":"[SOLID] \uac1d\uccb4 \uc9c0\ud5a5 \ud504\ub85c\uadf8\ub798\ubc0d(OOP) \uc6d0\uce59","authors":["kihyun"],"tags":["design pattern","rule"]},"prevItem":{"title":"Overloading & Overriding","permalink":"/blog/Overloading and Overriding"},"nextItem":{"title":"\uc804\ub7b5 \ud328\ud134 - Strategy pattern","permalink":"/blog/strategy pattern"}},"content":"## SRP ( \ub2e8\uc77c \ucc45\uc784\uc758 \uc6d0\uce59 : Single Responsibility Principle )\\n\\n## OCP ( \uacc4\ubc29-\ud3d0\uc1c4\uc758 \uc6d0\uce59 : Open Close Principle )\\n\\n1. \ubc14\ub00c\ub294 \ubd80\ubd84\uc744 \ucea1\uc290\ud654\ud55c\ub2e4.\\n    - \ubcc0\ud558\ub294(\ud655\uc7a5\ub418\ub294) \uac83\uacfc \ubcc0\ud558\uc9c0 \uc54a\uc744 \uac83\uc744 \uad6c\ubd84\\n\\n2. \uc0c1\uc18d\ubcf4\ub2e4\ub294 \uad6c\uc131\uc744 \ud65c\uc6a9\ud55c\ub2e4.\\n\\n3. \uad6c\ud604\ubcf4\ub2e4\ub294 \uc778\ud130\ud398\uc774\uc2a4\uc5d0 \ub9de\ucdb0\uc11c \ud504\ub85c\uadf8\ub798\ubc0d\ud55c\ub2e4.\\n    - \uc815\uc758\ud55c \uc778\ud130\ud398\uc774\uc2a4\uc5d0 \uc758\uc874\\n\\n4. \uc0c1\ud638\uc791\uc6a9\ud558\ub294 \uac1d\uccb4 \uc0ac\uc774\uc5d0\uc11c\ub294 \uac00\ub2a5\ud558\uba74 \ub290\uc2a8\ud55c \uacb0\ud569\uc744 \uc0ac\uc6a9\ud574\uc57c \ud55c\ub2e4.\\n\\n5. \ud074\ub798\uc2a4\ub294 \ud655\uc7a5\uc5d0\ub294 \uc5f4\ub824\uc788\uc5b4\uc57c \ud558\uace0 \ubcc0\uacbd\uc5d0\ub294 \ub2eb\ud600 \uc788\uc5b4\uc57c \ud55c\ub2e4.\\n\\n## LSP ( \ub9ac\uc2a4\ucf54\ud504 \uce58\ud658\uc758 \uc6d0\uce59 : The LisKov Substitution Principle )\\n\\n## ISP ( \uc778\ud130\ud398\uc774\uc2a4 \ubd84\ub9ac\uc758 \uc6d0\uce59 : Interface Segregation Principle )\\n\\n## DIP ( \uc758\uc874\uc131 \uc5ed\uc804\uc758 \uc6d0\uce59 : Dependency Inversion Principle )\\n\\n1. \ucd94\uc0c1\ud654\ub41c \uac83\uc5d0 \uc758\uc874\ud558\uac8c \ub9cc\ub4e4\uace0 \uad6c\uc0c1 \ud074\ub798\uc2a4\uc5d0 \uc758\uc874\ud558\uc9c0 \uc54a\uac8c \ub9cc\ub4e0\ub2e4.\\n\\n2. \uace0\uc218\uc900 \uad6c\uc131 \uc694\uc18c\uac00 \uc800\uc218\uc900 \uad6c\uc131 \uc694\uc18c\uc5d0 \uc758\uc874\ud558\uba74 \uc548\ub418\uace0 \ud56d\uc0c1 \ucd94\uc0c1\ud654\uc5d0 \uc758\uc874\ud558\uac8c \ub9cc\ub4e4\uc5b4\uc57c \ud55c\ub2e4.\\n`\uace0\uc218\uc900 \uad6c\uc131 \uc694\uc18c` : \ub2e4\ub978 `\uc800\uc218\uc900 \uad6c\uc131 \uc694\uc18c`\uc5d0 \uc758\ud574 \uc815\uc758\ub418\ub294 \ud589\ub3d9\uc774 \ub4e4\uc5b4\uc788\ub294 \uad6c\uc131 \uc694\uc18c\\n\\n3. \ubcc0\uc218\uc5d0 \uad6c\uc0c1 \ud074\ub798\uc2a4\uc758 \ub808\ud37c\ub7f0\uc2a4\ub97c \uc800\uc7a5\ud558\uc9c0 \uc54a\ub294\ub2e4.\\n\\n4. \uad6c\uc0c1 \ud074\ub798\uc2a4\uc5d0\uc11c \uc720\ub3c4\ub41c \ud074\ub798\uc2a4\ub97c \ub9cc\ub4e4\uc9c0 \uc54a\ub294\ub2e4.\\n\\n5. \ubca0\uc774\uc2a4 \ud074\ub798\uc2a4\uc5d0 \uc774\ubbf8 \uad6c\ud604\ub418\uc5b4 \uc788\ub294 \uba54\uc18c\ub4dc\ub97c \uc624\ubc84\ub77c\uc774\ub4dc\ud558\uc9c0 \uc54a\ub294\ub2e4."},{"id":"strategy pattern","metadata":{"permalink":"/blog/strategy pattern","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-08-29-stratgy/index.md","source":"@site/blog/2023-08-29-stratgy/index.md","title":"\uc804\ub7b5 \ud328\ud134 - Strategy pattern","description":"\uc815\uc758","date":"2023-08-29T00:00:00.000Z","formattedDate":"August 29, 2023","tags":[{"label":"design pattern","permalink":"/blog/tags/design-pattern"},{"label":"strategy pattern","permalink":"/blog/tags/strategy-pattern"}],"readingTime":1.465,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"strategy pattern","title":"\uc804\ub7b5 \ud328\ud134 - Strategy pattern","authors":["kihyun"],"tags":["design pattern","strategy pattern"]},"prevItem":{"title":"[SOLID] \uac1d\uccb4 \uc9c0\ud5a5 \ud504\ub85c\uadf8\ub798\ubc0d(OOP) \uc6d0\uce59","permalink":"/blog/design pattern rule"},"nextItem":{"title":"Welcome","permalink":"/blog/welcome"}},"content":"## \uc815\uc758\\n\\n\uc54c\uace0\ub9ac\uc998\uad70\uc744 \uc815\uc758\ud558\uace0 \ucea1\uc290\ud654\ud574\uc11c \uac01\uac01\uc758 \uc54c\uace0\ub9ac\uc998\uad70\uc744 \uc218\uc815\ud574\uc11c \uc4f8 \uc218 \uc788\uac8c \ud574\uc900\ub2e4.\\n\uc804\ub7b5 \ud328\ud134\uc744 \uc0ac\uc6a9\ud558\uba74 \ud074\ub77c\uc774\uc5b8\ud2b8\ub85c\ubd80\ud130 \uc54c\uace0\ub9ac\uc998\uc744 \ubd84\ub9ac\ud574\uc11c \ub3c5\ub9bd\uc801\uc73c\ub85c \ubcc0\uacbd\ud560 \uc218 \uc788\ub2e4.\\n\\n## \ud2b9\uc9d5\\n\\n- \ud568\uc218 \uc911 \ubcc0\ud558\ub294 \ucf54\ub4dc\ub97c class\ub85c \uad6c\ud604\ud558\uc5ec \uc0c1\uc18d\ubc1b\ub294 \uac83\uc774 \uc544\ub2cc interface\ub85c \uad6c\ud604\ud558\uc5ec\uc11c Composition\ud558\ub294\uac8c \uc88b\ub2e4.\\n\\n## \uc608\uc2dc\\n\\n```java title=\\"/src/interfaces/FlyBehavior.java\\"\\npublic interface FlyBehavor {\\n    public void fly();\\n}\\n```\\n\uc704 \ucc98\ub7fc \ub098\ub294 \ud589\ub3d9 \uc778\ud130\ud398\uc774\uc2a4\ub97c \uad6c\ud604\ud558\uace0\\n\\n```java title=\\"/src/classes/Duck.java\\"\\npublic abstract class Duck {\\n    FlyBehavor flyBehavor;\\n\\n    public void setFlyBehavor(FlyBehavor flyBehavor) {\\n        this.flyBehavor = flyBehavor;\\n    }\\n}\\n```\\n\ucd94\uc0c1 \ud074\ub798\uc2a4\uc5d0\uc120 interface \uc120\uc5b8 \ubc0f setter\ub97c \uad6c\ud604\ud558\uace0\\n\\n```java title=\\"/src/classes/FlyNoway ... FlyWithWings.java\\"\\npublic class FlyNoWay implements FlyBehavor {\\n    @Override\\n    public void fly() {\\n        System.out.println(\\"I can\'t fly ! TT\\");\\n    }\\n}\\n\\npublic class FlyRocketPowered implements FlyBehavor {\\n    @Override\\n    public void fly() {\\n        System.out.println(\\"ROCKET FLY!!\\");\\n    }\\n}\\n\\npublic class FlyWithWings implements FlyBehavor {\\n    @Override\\n    public void fly() {\\n        System.out.println(\\"I can fly!!\\");\\n    }\\n}\\n```\\n\\n\uc704 \ucf54\ub4dc\ub4e4\ucc98\ub7fc interface\ub97c \uad6c\ud604\ud558\uc5ec\uc11c \uc624\ubc84\ub77c\uc774\ub529\uc744 \ud569\ub2c8\ub2e4.\\n\\n```java title=\\"/src/classes/MallardDuck.java\\"\\npublic class MallardDuck extends Duck{\\n    public MallardDuck(){\\n        flyBehavor = new FlyWithWings();\\n    }\\n}\\n```\\n\uc0dd\uc131\uc790\uc5d0\uc11c \uc0c8\ub85c \uad6c\ud604\ud55c \uc778\ud130\ud398\uc774\uc2a4\ub85c \uc0dd\uc131\ud569\ub2c8\ub2e4."},{"id":"welcome","metadata":{"permalink":"/blog/welcome","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-08-29-welcome/index.md","source":"@site/blog/2023-08-29-welcome/index.md","title":"Welcome","description":"Docusaurus \uccab\ubc88\uc9f8 \uae00\uc774\ub2e4.","date":"2023-08-29T00:00:00.000Z","formattedDate":"August 29, 2023","tags":[{"label":"docusaurus","permalink":"/blog/tags/docusaurus"},{"label":"first post","permalink":"/blog/tags/first-post"}],"readingTime":0.095,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["kihyun"],"tags":["docusaurus","first post"]},"prevItem":{"title":"\uc804\ub7b5 \ud328\ud134 - Strategy pattern","permalink":"/blog/strategy pattern"}},"content":"Docusaurus \uccab\ubc88\uc9f8 \uae00\uc774\ub2e4.\\n\\n![Docusaurus Plushie](./docusaurus-plushie-banner.jpeg)\\n\\n\uadc0\uc5ec\uc6b4 \uacf5\ub8e1 \uc778\ud615\uc774 \uc788\ub2e4."}]}')}}]);